(49, 'aRichText', NULL, '\n\n\n\n      <p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<b>Club C.N.A.</b><br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n       Pintos 2302, Parada Malaver, Moreno<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n       (altura ruta 23 al 5600)<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n       10 minutos del Parque en auto<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n       Caba&ntilde;as para 6/8 personas (llevar sabanas y toallas, hay manta y calefaccion a le&ntilde;a provista por el club)<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n       Costo por caba&ntilde;a por dia $ 110.- (aprox $ 20.- por persona por dia)<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n       Telefono del Encargado VICTOR: (0237-481 3081) y cel: 114449 0700 <br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<b>CABA&Ntilde;AS SINDICATO DE TV - CAMPING 12 DE AGOSTO</b><br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n       4 PERSONAS POR CABA&Ntilde;A - $ 50.- POR PERSONA CON DESAYUNO INCLUIDO<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n       CALLE LA PIEDAD AL 1600<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n       CELULAR DEL ADMINISTRADOR (CARLOS) 011 15 5625 1122<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<b>Florencia</b>: encargada de unas caba&ntilde;as cerca del Parque<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n       Cerca de la calle Rub&eacute;n Dar&iacute;o.<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n       CELULAR: 11 664 88455</p>\n      \n\n'),
