(72, 'aText', NULL, 'cartas '),
(73, 'aRichText', NULL, '\n\n\n\n      <p>\n&nbsp;Queridos amigos&lt;br&gt;&lt;br&gt;       El Tercer Retiro de Postulantes se desarrollar en dos das, el 3 y 4 de julio,       comenzando cada da a las 8 de la maana y finalizando a las 20.00 Hs. en todos       los Parques de Estudio y Reflexin Reconocidos por la Escuela.&lt;br&gt;&lt;br&gt;       Recordamos a todos los postulantes que tienen que llevar sus trabajos (sntesis       de Psicologa III y IV, y opcionalmente, si lo desearan su sntesis de los trabajos       sobre Eplogo y Operativa) en formato digital. Los mismos debern mostrarse       al inicio de la Reunin en las mesas dispuestas para acreditacin y entrega de       Materiales.&lt;br&gt;&lt;br&gt;       Tambin ser adecuado prever alojamiento, para el da 3 en la noche, en las       cercanas del Parque al que se concurra (en algunos casos, viajando de lejos ser       conveniente tambin el da 2).&lt;br&gt;&lt;br&gt;       El Costo del Retiro es de $150&lt;br&gt;&lt;br&gt;       Les deseamos a todos un buen trabajo&lt;br&gt;&lt;br&gt;       Comisin Parque La Reja</p>\n      \n\n'),
(74, 'aRichText', NULL, '\n\n\n\n      <p>Queridos amigos<br><br>El Tercer Retiro de Postulantes se desarrollar&aacute; en dos d&iacute;as, el 3 y 4 de julio, comenzando cada d&iacute;a a las 8 de la ma&ntilde;ana y finalizando a las 20.00 Hs. en todos los Parques de Estudio y Reflexi&oacute;n Reconocidos por la Escuela.<br><br>Recordamos a todos los postulantes que tienen que llevar sus trabajos (s&iacute;ntesis de Psicolog&iacute;a III y IV, y opcionalmente, si lo desearan su s&iacute;ntesis de los trabajos sobre Ep&iacute;logo y Operativa) en formato digital. Los mismos deber&aacute;n mostrarse al inicio de la Reuni&oacute;n en las mesas dispuestas para acreditaci&oacute;n y entrega de Materiales.<br><br>Tambi&eacute;n ser&aacute; adecuado prever alojamiento, para el d&iacute;a 3 en la noche, en las cercan&iacute;as del Parque al que se concurra (en algunos casos, viajando de lejos ser&aacute; conveniente tambi&eacute;n el d&iacute;a 2).<br><br>El Costo del Retiro es de $150<br><br>Les deseamos a todos un buen trabajo<br><br>Comisi&oacute;n Parque La Reja</p>\n      \n\n'),
(75, 'aBlogSingle', NULL, 'a:2:{s:9:"blog_item";s:1:"3";s:6:"search";s:63:"Carta para el tercer Retiro de Postulantes del 3 y 4 julio 2010";}'),
