(121, 'fPark', NULL, 'a:3:{s:3:"url";s:33:"http://www.parquemanantiales.org/";s:5:"title";s:27:"Parque Manantiales, Chile  ";s:4:"text";s:312:"Los Manantiales está ubicado a 70 Km al norte de Santiago, Chile, en un terreno de 1,3 hectáreas. El Complejo de Los Manantiales consiste en una Sala, un Monolito, una sala multiuso, una estela de acero inoxidable con los nombres de todos aquellos que contribuyeron para su construcción y una fuente de agua. ";}'),
