(137, 'aRichText', NULL, '\n\n\n\n      <h3>&nbsp;Otros Parques en el Mundo</h3>\n<p>\nSon espacios abiertos al Estudio y Reflexi&oacute;n, para profundizar en nosotros mismos y favorecer la no-discriminaci&oacute;n, el afecto y la reciprocidad en el trato a los dem&aacute;s.<br>\n<br>\n\nAspiramos a que desde ellos surja una verdadera oleada de buenos sentimientos que ayuden a develar lo Sagrado en uno y fuera de uno, permiti&eacute;ndonos comprender que no estamos solos en este mundo ni en los infinitos mundos.&nbsp;<br>\n<br>\n\nConozca el Parque de Estudio y Reflexi&oacute;n La Reja a trav&eacute;s de&nbsp;<a href="#">este video</a></p>\n<h3>El Parque tiene los siguientes elementos</h3>\n      \n\n'),
