(143, 'fSnapShot', NULL, 'a:4:{s:3:"url";s:28:"http://www.parquetoledo.org/";s:5:"title";s:23:"Parque Toledo, España ";s:4:"text";s:341:"El Parque Toledo está ubicado en la provincia de Toledo a 55 Km. de Madrid.\nDesde Madrid se toma la M30 ó M40 para coger la Autovía Nacional A-4 en dirección a Córdoba. Pasada la salida a Aranjuez, siguiendo por la Autovía y subiendo por una pequeña cuesta, se comienza a ver a la distancia, hacia la derecha, los terrenos del Parque.";s:5:"align";s:5:"right";}'),
