(187, 'aRichText', NULL, '\n\n\n\n      <p>\n\n\n\n&nbsp;Queridos amigos<br>\n\n\n\n<br>\n\n\n\n Esta es la lista definitiva de los 13 Parques de Estudio y Reflexi&oacute;n donde se realizar&aacute;n las ceremonias de ingreso a Escuela el d&iacute;a 17 de julio.<br>\n\n\n\n<br>\n\n\n\n Los que postulan a Escuela deber&iacute;an concurrir a los parques donde han llevado adelante su proceso.<br>\n\n\n\n<br>\n\n\n\n Los disc&iacute;pulos deben ir a los parques m&aacute;s cercanos donde han llevado su proceso de nivelaci&oacute;n.<br>\n\n\n\n<br>\n\n\n\n<b>&nbsp;&nbsp;&middot;&nbsp;</b>Attigliano<br>\n\n\n\n<b>&nbsp;&nbsp;&middot;&nbsp;</b>Belle Idee<br>\n\n\n\n<b>&nbsp;&nbsp;&middot;&nbsp;</b>Carcara&ntilde;&aacute;<br>\n\n\n\n<b>&nbsp;&nbsp;&middot;&nbsp;</b>Casa Giorgi<br>\n\n\n\n<b>&nbsp;&nbsp;&middot;&nbsp;</b>Caucaia<br>\n\n\n\n<b>&nbsp;&nbsp;&middot;&nbsp;</b>Kandhroli<br>\n\n\n\n<b>&nbsp;&nbsp;&middot;&nbsp;</b>La Reja<br>\n\n\n\n<b>&nbsp;&nbsp;&middot;&nbsp;</b>La Uni&oacute;n<br>\n\n\n\n<b>&nbsp;&nbsp;&middot;&nbsp;</b>Manantiales<br>\n\n\n\n<b>&nbsp;&nbsp;&middot;&nbsp;</b>Mikebuda<br>\n\n\n\n<b>&nbsp;&nbsp;&middot;&nbsp;</b>Punta de Vacas<br>\n\n\n\n<b>&nbsp;&nbsp;&middot;&nbsp;</b>Red Bluff<br>\n\n\n\n<b>&nbsp;&nbsp;&middot;&nbsp;</b>Toledo<br>\n\n\n\n<br>\n\n\n\n<br>\n\n\n\n Por favor destaca esta informaci&oacute;n en los paginas web&acute;s de cada parque para que los disc&iacute;pulos puedan hacer sus planes y calendarios.<br>\n\n\n\n<br>\n\n\n\n Un gran abrazo,<br>\n\n\n\n<br>\n\n\n\n Karen Silvia y Andr&eacute;s</p>\n      \n\n'),
