(279, 'aText', NULL, 'Nota acerca del proceso Disciplinario en los Parques - 17/05/2010'),
(280, 'aText', NULL, ''),
(281, 'aRichText', NULL, '\n\n\n\n      <p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n&nbsp;Queridos Amigos,<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nHemos recibido varias preguntas relativas al per&iacute;odo final del proceso disciplinario.<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nA los Disc&iacute;pulos s&oacute;lo se les pide asistir a las 3 reuniones de los Trabajos de Escuela que son la primera, segunda y tercera reuni&oacute;n que se realizan en los Parques de Estudio y Reflexi&oacute;n.<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nLa tercera y &uacute;ltima reuni&oacute;n de los Disc&iacute;pulos se celebrar&aacute; este s&aacute;bado, el 22 de mayo. No hay otras reuniones obligatorias.<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nLos Disc&iacute;pulos que asistan a la tercera reuni&oacute;n, se les informar&aacute; m&aacute;s adelante de los procedimientos involucrados con la terminaci&oacute;n de su trabajo disciplinario antes del 17 de julio.<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nun c&aacute;lido saludo<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nKaren, Silvia y Andr&eacute;s</p>\n      \n\n'),
