(308, 'fSnapShot', NULL, 'a:4:{s:3:"url";s:34:"http://www.parquepuntadevacas.org/";s:5:"title";s:35:"Parque Histórico de Punta de Vacas";s:4:"text";s:194:"Argentina\nEstá ubicado en la provincia de Mendoza, Argentina, en la pequeña localidad de Punta de Vacas en medio de la cordillera a 176 kilómetros de Mendoza, a los pies del monte Aconcagua. ";s:5:"align";s:4:"left";}'),
(309, 'fSnapShot', NULL, 'a:4:{s:3:"url";s:34:"http://www.parquepuntadevacas.org/";s:5:"title";s:35:"Parque Histórico de Punta de Vacas";s:4:"text";s:194:"Argentina\nEstá ubicado en la provincia de Mendoza, Argentina, en la pequeña localidad de Punta de Vacas en medio de la cordillera a 176 kilómetros de Mendoza, a los pies del monte Aconcagua. ";s:5:"align";s:4:"left";}'),
(310, 'fSnapShot', NULL, 'a:4:{s:3:"url";s:34:"http://www.parquepuntadevacas.org/";s:5:"title";s:46:"Parque Histórico de Punta de Vacas, Argentina";s:4:"text";s:184:"Está ubicado en la provincia de Mendoza, Argentina, en la pequeña localidad de Punta de Vacas en medio de la cordillera a 176 kilómetros de Mendoza, a los pies del monte Aconcagua. ";s:5:"align";s:4:"left";}'),
(311, 'fSnapShot', NULL, 'a:4:{s:3:"url";s:33:"http://www.parquemanantiales.org/";s:5:"title";s:29:"Parque Los Manantiales, Chile";s:4:"text";s:312:"Los Manantiales está ubicado a 70 Km al norte de Santiago, Chile, en un terreno de 1,3 hectáreas. El Complejo de Los Manantiales consiste en una Sala, un Monolito, una sala multiuso, una estela de acero inoxidable con los nombres de todos aquellos que contribuyeron para su construcción y una fuente de agua. ";s:5:"align";s:4:"left";}'),
(312, 'fSnapShot', NULL, 'a:4:{s:3:"url";s:28:"http://www.parquetoledo.org/";s:5:"title";s:23:"Parque Toledo, España ";s:4:"text";s:342:"El Parque Toledo está ubicado en la provincia de Toledo a 55 Km. de Madrid.\nDesde Madrid se toma la M30 ó M40 para coger la Autovía Nacional A-4 en dirección a Córdoba. Pasada la salida a Aranjuez, siguiendo por la Autovía y subiendo por una pequeña cuesta, se comienza a ver a la distancia, hacia la derecha, los terrenos del Parque. ";s:5:"align";s:4:"left";}'),
(313, 'fSnapShot', NULL, 'a:4:{s:3:"url";s:28:"http://www.redbluffpark.org/";s:5:"title";s:32:"Parque Red Bluff, Estados Unidos";s:4:"text";s:263:"El terreno para la Sala Norte fue adquirido el 31 de marzo del 2006 en Red Bluff, California. Se trata de una parcela de 4 acres y medio localizada en una zona agrícola a 2 millas de los límites de la ciudad de Red Bluff, bordeando la autopista histórica 99E. ";s:5:"align";s:4:"left";}'),
(314, 'fSnapShot', NULL, 'a:4:{s:3:"url";s:30:"http://www.parcoattigliano.it/";s:5:"title";s:25:"Parque Attigliano, Italia";s:4:"text";s:204:"El sábado 13 de enero de 2007 a los12:00  horas se inauguró el Parque de Attigliano.\nEstá ubicado en la región de Umbria, Italia, y se llega por la autopista Roma-Firenze A1 (E35) - Salida ATTIGLIANO.";s:5:"align";s:4:"left";}'),
(315, 'fSnapShot', NULL, 'a:4:{s:3:"url";s:27:"http://www.asianashram.net/";s:5:"title";s:19:"Asian Ashram, India";s:4:"text";s:301:"El terreno está situado en dirección sureste desde Mumbai a una distancia de 81 kilómetros, en el pueblo Kandharolia, Block Khalapur, Distrito Raigad. La superficie del terreno es de 13.410 metros cuadrados. El poblado más cercano es Khopoli. El tiempo de viaje desde Mumbai es de 2 a tres horas. ";s:5:"align";s:4:"left";}'),
(316, 'fSnapShot', NULL, 'a:4:{s:3:"url";s:27:"http://www.parquechaco.org/";s:5:"title";s:23:"Parque Chaco, Argentina";s:4:"text";s:183:"Su construcción se inició en 1975. Sirvió de maqueta y experimentación para otras Salas.\nPor otra parte, es la primera Sala construida por un grupo familiar, la familia Kohanoff. ";s:5:"align";s:4:"left";}'),
