(318, 'fSnapShot', NULL, 'a:4:{s:3:"url";s:31:"http://www.parquecarcarana.org/";s:5:"title";s:29:"Parque Carcarañá, Argentina";s:4:"text";s:172:"El Parque se encuentra ubicado en la Provincina de Santa Fe, Argentina a solo 35 km de la ciudad de Rosario, en la Comuna de Lucio V. López bordeando el río Carcarañá. ";s:5:"align";s:4:"left";}'),
(319, 'fSnapShot', NULL, 'a:4:{s:3:"url";s:29:"http://www.parquelaunion.org/";s:5:"title";s:26:"Parque La Unión, Colombia";s:4:"text";s:237:"Está ubicado a unos 45 km de Bogotá, por la carretera que conduce al municipio de Choachi y a 5 minutos del municipio La Unión. Clima templado. Cuenta con el Centro de Trabajo, con capacidad de alojamiento para unas 12 a 14 personas. ";s:5:"align";s:4:"left";}'),
