(341, 'aRichText', NULL, '\n\n\n\n      <p>La tercera y &uacute;ltima reuni&oacute;n de los Disc&iacute;pulos se celebrar&aacute; este s&aacute;bado, el 22 de mayo. No hay otras reuniones obligatorias.<br><br>                    Los Disc&iacute;pulos que asistan a la tercera reuni&oacute;n, se les informar&aacute; m&aacute;s  adelante de los procedimientos involucrados con la terminaci&oacute;n de su  trabajo disciplinario antes del 17 de julio.<br><br>                    un c&aacute;lido saludo<br><br>                    Karen, Silvia y Andr&eacute;s</p>\n      \n\n'),
(342, 'aRichText', NULL, '\n\n\n\n      <p>&nbsp;Queridos Amigos,<br><br>                      Hemos recibido varias preguntas relativas al per&iacute;odo final del proceso disciplinario.<br><br>                      A los Disc&iacute;pulos s&oacute;lo se les pide asistir a las 3 reuniones de los Trabajos de Escuela que son la primera, segunda y tercera reuni&oacute;n que se realizan en los Parques de Estudio y Reflexi&oacute;n.<br></p>\n      \n\n'),
