(352, 'aText', NULL, 'Acerca de las reuniones de Nivelaci&oacute;n y de Disc&iacute;pulos - 21/04/2010'),
(353, 'aText', NULL, ''),
(354, 'aRichText', NULL, '\n\n\n\n      <p>\n\n\n\n\n\n\n\n\n\n\n\nQueridos Amigos,<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nEn relaci&oacute;n a las consultas que se han suscitado este &uacute;ltimo tiempo respecto de aquellas personas que han tenido dificultades de concurrir a su reuni&oacute;n de nivelaci&oacute;n o de cambio de cuaterna en el caso de los procesos disciplinarios te comento que se ha visto conveniente lo siguiente:<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nLos procesos de nivelaci&oacute;n son una unidad en si misma, se entrega en tres reuniones, dos de 1 d&iacute;a y una tercera de dos d&iacute;as y ninguna de estas reuniones contemplan d&iacute;as de recuperaci&oacute;n. Es decir, aquel que no puede concurrir a las tres reuniones previstas para esto, no concluye su proceso y debe retomarlo desde el principio si hubiere una nueva oportunidad de nivelaci&oacute;n.<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nLos procesos disciplinarios tambi&eacute;n son una unidad en si misma, diferenciados en tres cuaternas, que se entregan en tres reuniones, de 1 d&iacute;a cada una y ninguna de estas reuniones contemplan d&iacute;as de recuperaci&oacute;n. Es decir, aquel que no puede concurrir a las tres reuniones previstas para esto, no concluye su proceso disciplinario y debe retomarlo desde el principio si hubiere una nueva oportunidad de recibir nuevamente las tres cuaternas de una determinada Disciplina. En este caso, bastar&aacute; que se inserte en el nuevo proceso disciplinario, desde la primera cuaterna, sin pasar nuevamente por el proceso de nivelaci&oacute;n (a menos que le parezca adecuado al participante efectuarlo nuevamente).<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nCon esto dejamos claro que no habr&aacute; casos de excepci&oacute;n en la nivelaci&oacute;n y en las disciplinas. Tampoco habr&aacute; cambios de una disciplina a otra durante el proceso disciplinario.<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nRecibe un afectuoso abrazo.<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nPancho y Robby</p>\n      \n\n'),
