(369, 'aRichText', NULL, '\n\n\n\n      <p>Queridas amigas y amigos,<br><br>1) Pr&oacute;ximamente tendremos una reuni&oacute;n con todos los maestros y los postulantes a maestros. Eso se producir&aacute; el d&iacute;a s&aacute;bado 29 de mayo y agregaremos un d&iacute;a para mejorar los detalles que se produzcan en esta situaci&oacute;n. Empezaremos el d&iacute;a s&aacute;bado 29 a las 12 y concluiremos el domingo 30, en horas de la tarde. Eso ser&aacute; en el Centro de Estudios de Punta de Vacas y en la Sala; y se producir&aacute; la revisi&oacute;n y promoci&oacute;n a Escuela.<br><br>Al momento hay 53 miembros de Escuela y 68 posibles postulantes.&nbsp;<br><br>Terminadas todas las operaciones mencionadas estaremos en condiciones de acometer los trabajos de Escuela en su totalidad.&nbsp;<br><br><br>2) El d&iacute;a s&aacute;bado 17 de julio, a las 12, haremos las reuniones de incorporaci&oacute;n a Escuela, con todos aquellos que se sientan y est&eacute;n en condiciones de pasar a esta etapa, simult&aacute;nea y &uacute;nicamente en los Parques de Estudio y Reflexi&oacute;n (reconocidos por la Escuela).<br><br>Cumplida esta etapa contaremos con un n&uacute;mero de maestros superior al millar.&nbsp;<br><br>Los Parques en esos momentos quedaran organizativamente descentralizados.<br><br><br>3) Hasta el momento est&aacute; previsto que solamente 126 inscriptos participen de las actividades de lo que fue llamada la tercera camada de nivelaci&oacute;n prevista para el 29 de mayo &hellip;&hellip;.. eso no podr&aacute; ser y es preferible que los 126 inscriptos se reserven para los &uacute;ltimos d&iacute;as de diciembre, en que se dar&aacute; inicio a una definitiva nivelaci&oacute;n y al trabajo correspondiente de Escuela.<br><br><br>Los saludamos afectuosamente,<br>Silvia, Karen, Pancho, Robby, Eduardo, Hugo, Mariana y Antonio<br>por la Escuela<br>16 de abril de 2010.</p>\n      \n\n'),
