(376, 'aRichText', NULL, '\n\n\n\n      <p>\n\n\n\nQueridos amigos,<br>\n\n\n\n<br>\n\n\n\nLos Parques que, &nbsp;al d&iacute;a 31 de julio del 2010,&nbsp; est&aacute;n en condiciones de llevar adelante los trabajos de Escuela de la segunda y cuarta camada son los siguientes:<br>\n\n\n\n<strong>1 Red Bluff, Estados Unidos</strong>, falta taller, falta terminar C de T, falta&nbsp; C de E<br>\n\n\n\n<strong>2 Hudson Valley, Estados Unidos</strong>, no hay pagina web. Falta terminaciones en&nbsp; C de T, falta taller y falta C de E<br>\n\n\n\n<br>\n\n\n\n<strong>3 La Uni&oacute;n, Colombia</strong>,&nbsp; falta un buen sistema de banda ancha. Falta C de E&nbsp;<br>\n\n\n\n<strong>4 Montecillo, Bolivia</strong>,&nbsp; Falta taller y C de E<br>\n\n\n\n<strong>5 Caucaia, Brasil</strong>. Falta C de E.<br>\n\n\n\n<strong>6 Piribebuy, Paraguay</strong>. Falta taller.<br>\n\n\n\n<strong>7 Los Manantiales, Chile.</strong><br>\n\n\n\n<strong>8 Punta de Vacas, Argentina</strong><br>\n\n\n\n<strong>9 La Reja, Argentina</strong><br>\n\n\n\n<strong>10 Carcara&ntilde;a, Argentina</strong>. Falta C de E<br>\n\n\n\n<strong>11 Chaco, Argentina</strong>. Falta C de E<br>\n\n\n\n<strong>12 Patagonia Norte, Argentina</strong>. Falta remodelaci&oacute;n del C de E y taller.<br>\n\n\n\n<br>\n\n\n\n<strong>13 Toledo, Espa&ntilde;a</strong>, C de T en construcci&oacute;n.<br>\n\n\n\n<strong>14 Attigliano, Italia</strong>, falta C de E.,&nbsp;<br>\n\n\n\n<strong>15 Casa Giorgi, Italia</strong>. Falta C de E<br>\n\n\n\n<strong>16&nbsp; La Belle Id&eacute;e, Francia.</strong><br>\n\n\n\n<strong>17 Mikebuda, Hungria</strong>, falta C de E.&nbsp;<br>\n\n\n\n<strong>18 Berlin, Alemania</strong>, falta definir destino de las edificaciones.&nbsp;<br>\n\n\n\n<br>\n\n\n\n<strong>19 Kandharoli, India</strong>, falta completar C de T, falta C de E y banda ancha<br>\n\n\n\n<strong>20 Banahaw, Filipinas</strong>, falta taller y C de E.<br>\n\n\n\n<br>\n\n\n\n<br>\n\n\n\n<br>\n\n\n\nLas condiciones adecuadas para que un Parque pueda operar son: Comisi&oacute;n, legalidad, personal de Escuela, Edificaciones (C de T y/o C de E, taller) y&nbsp; capacidad de conexi&oacute;n con el conjunto por banda ancha.<br>\n\n\n\n<br>\n\n\n\nExisten otros Parques y proyectos que est&aacute;n en proceso en este ultimo tiempo&nbsp; y no est&aacute;n en condiciones adecuadas para llevar adelante los trabajos de Escuela. Despu&eacute;s de Enero del 2011 retomaremos este tema de los nuevos Parques.&nbsp;&nbsp;<br>\n\n\n\n<br>\n\n\n\nAl 31 de julio del 2010 consideramos solo estos 20 Parques funcionando. Y a los que les falta para estar en condiciones, no los consideramos en esta etapa.<br>\n\n\n\n<br>\n\n\n\nSon requisitos indispensables para ser Parque los ya vistos.&nbsp; Esos son los Parques en funcionamiento, y respecto de los dem&aacute;s veremos para cuando cumplan las condiciones, despu&eacute;s de enero del 2011.<br>\n\n\n\n<br>\n\n\n\nRespecto de la autonom&iacute;a de los Parques, no podemos hablar de ella mientras no hayan Parques. Si son aut&oacute;nomos, significa que no tienen que pedir opini&oacute;n a ninguna otra gente que no este en esos Parques. Son justamente esos Parques quienes deciden sobre ellos y no otros. Esta autonom&iacute;a parte en enero del 2011.<br>\n\n\n\n<br>\n\n\n\nEn cuanto a Maestros. &iquest;Quienes son los Maestros al d&iacute;a de hoy? Los que han hecho los trabajos de Escuela. Entonces, para que un Parque tenga autonom&iacute;a , debe reunir los requisitos ya dichos y personal de Escuela.<br>\n\n\n\n<br>\n\n\n\nDe la primera camada no hay nada que revisar. No as&iacute; con la segunda camada, quienes est&aacute;n haciendo sus cosas y cierran su proceso a fines de noviembre.&nbsp; La tercera camada nunca existi&oacute; ni aporto nada. As&iacute; las cosas, nada impide que la cuarta camada comience. Tenemos los nombres de los Maestros de la primera camada. Y los que inician su segunda camada, &nbsp;sabremos el 7 de agosto quienes son al ir estos a los 20 Parques. No hay otros mas. Son reales y no son listas que circulan.&nbsp;<br>\n\n\n\n<br>\n\n\n\nTambi&eacute;n sabemos cuales son estos 20 Parques que van a trabajar para sacar&nbsp; nuevos Maestros. La primera camada ya concluyo y&nbsp; la tercera camada jam&aacute;s existi&oacute;.&nbsp; De la 2&ordf; camada,&nbsp; se le empieza a seguir la pista el 7 de agosto y despu&eacute;s habr&aacute; elecciones con los que concluyan.&nbsp;<br>\n\n\n\n<br>\n\n\n\nEl tema es cuando podr&aacute; abrirse el trabajo de nivelaci&oacute;n para la cuarta camada.&nbsp; La iniciaremos el 14 de agosto pr&oacute;ximo (recordemos que hoy estamos a 1 de agosto). Los que asistan son quienes ir&aacute;n en la v&iacute;a&nbsp; de&nbsp; la cuarta camada. La nivelaci&oacute;n puede ser mas corta, dos meses. Cada paso disciplinario se trabaja una semana,. En la primera reuni&oacute;n del proceso disciplinario se hace entrega de la primera cuaterna. Recomendamos, una vez mas, hacer estos trabajos en los Parques. Para mediados de Enero de 2011 tenemos armado todo. Maestros con los trabajos hechos y elegidos. Maestros son Maestros, vengan de la primera, segunda o cuarta camada. Y podemos hacer en simultaneo, con todos ellos, los ex&aacute;menes de obra y la entrega de la Ascesis. Ah&iacute; cerramos toda esa etapa.&nbsp;<br>\n\n\n\n<br>\n\n\n\n&iquest;Y que es la Escuela?. Ese conjunto de Maestros con y en sus lugares respectivos.&nbsp;<br>\n\n\n\n<br>\n\n\n\nY ah&iacute;,&nbsp; al dar ese examen de obra con los elementos finales, diremos como van a funcionar los Parques aut&oacute;nomos. Se cierra esta etapa&nbsp; a mediados de enero.&nbsp;<br>\n\n\n\n<br>\n\n\n\nY podr&iacute;a ser que en esos dos d&iacute;as de enero juntemos a toda la gente de Escuela, podemos hacerlo a mediados de enero,&nbsp; en P de V. Nos distribuiremos con la gente en los lugares cercanos al Parque. P de V es un punto de convergencia en este caso,&nbsp; pero lo que cuenta es cada Parque. Podemos preparar con tiempo una reuni&oacute;n masiva para mediados de enero.&nbsp;<br>\n\n\n\n<br>\n\n\n\nEstamos avisando de todo esto&nbsp; y tambi&eacute;n de los hitos previstos para la segunda y cuarta camada.&nbsp;<br>\n\n\n\n<br>\n\n\n\n&nbsp;<br>\n\n\n\n<br>\n\n\n\n<strong>Autonom&iacute;a de los Parques.</strong><br>\n\n\n\n<br>\n\n\n\nSon los que ponen en marcha los Parques, se equivoquen o no,&nbsp; los que tomaran las decisiones. Esa es la gente que se encargara y dar&aacute; las direcciones. Y si se equivocan&nbsp; chocaran con la gente de todo ese Parque. No es que una persona se encarga singularmente, son los que han hecho la cosa, que es lo que corresponde.&nbsp;<br>\n\n\n\n<br>\n\n\n\nCuando comienza a desarrollarse la autonom&iacute;a de implementaci&oacute;n los Parques ir&aacute;n decidiendo&nbsp;&nbsp; realmente. Pero no vamos&nbsp; a tener una organizaci&oacute;n centralizada, no existe tal cosa.&nbsp;<br>\n\n\n\n<br>\n\n\n\nEn lo que se ve, de los Parques que est&aacute;n funcionando, todo muy bien con la gente. Algunos Parques ser&aacute;n mas aceptables que otros, algunas situaciones ser&aacute;n mas favorables, y todo eso esta bien. El problema va a ser&nbsp; cuando se pisen (cuando se saturen) en la superpoblacion. Entonces se pensar&aacute; en abrir otro Parque. Y es como si lo hicieran de cero. Ac&aacute; tenemos poco espacio dir&aacute;n y vamos a abrir otro Parque. Y en el futuro, los Parques podr&aacute;n hacer sus propios procesos de nivelaci&oacute;n y disciplinas, sin pedirle consejo a nadie.&nbsp;<br>\n\n\n\n<br>\n\n\n\nEs muy posible que los Parques vayan creciendo as&iacute;. Y nadie mas autorizado que ellos (los que los montaron)&nbsp; para poner en marcha un nuevo Parque. Si hay suficiente fuerza, puede tomar un impulso importante este asunto de la apertura de los nuevos Parques. Es interesante y lo justo es que se encarguen de la apertura de nuevos Parques esos que pusieron en marcha un Parque. Tiene sabor de justicia, los que han montado cosas y ahora deciden montar nuevas cosas, &iquest;porque no? No hay que pedirle permiso a nadie. &iquest;Y a partir de cuando? De cuando ellos quieran.&nbsp;<br>\n\n\n\n<br>\n\n\n\nEsto es lo que hace al funcionamiento de esta etapa. Y no lo dejamos en manos de listados, la gente lo toma y lo hace o no lo hace.&nbsp;&nbsp;&nbsp;<br>\n\n\n\n<br>\n\n\n\n&nbsp;<br>\n\n\n\n<br>\n\n\n\n<strong>Calendario.</strong><br>\n\n\n\n<br>\n\n\n\n&nbsp;<br>\n\n\n\n<br>\n\n\n\n<strong>Segunda camada:&nbsp;</strong><br>\n\n\n\n<br>\n\n\n\nProceso Disciplinario<br>\n\n\n\n<br>\n\n\n\n7 de agosto:&nbsp; primera cuaterna<br>\n\n\n\n<br>\n\n\n\n18 de septiembre:&nbsp; segunda cuaterna<br>\n\n\n\n<br>\n\n\n\n23 de octubre: tercera cuaterna<br>\n\n\n\n<br>\n\n\n\n4 de diciembre: postulaci&oacute;n e ingresos a Escuela<br>\n\n\n\n<br>\n\n\n\n<strong>Cuarta camada</strong>:&nbsp;<br>\n\n\n\n<br>\n\n\n\nProceso de Nivelaci&oacute;n<br>\n\n\n\n<br>\n\n\n\n14 de agosto: primera reunion<br>\n\n\n\n<br>\n\n\n\n11 de septiembre: segunda reunion&nbsp;<br>\n\n\n\n<br>\n\n\n\n9 de octubre: tercera reunion y presentaci&oacute;n de Las Cuatro Disciplinas<br>\n\n\n\n<br>\n\n\n\nProceso Disciplinario<br>\n\n\n\n<br>\n\n\n\n16 de octubre: primera cuaterna<br>\n\n\n\n<br>\n\n\n\n13 de noviembre: segunda cuaterna<br>\n\n\n\n<br>\n\n\n\n11 de diciembre: tercera cuaterna<br>\n\n\n\n<br>\n\n\n\n8 de enero de 2011: postulaciones e ingresos a Escuela<br>\n\n\n\n<br>\n\n\n\n15 y 16 de enero:&nbsp; reuni&oacute;n conjunta de Escuela y exclusiva de todos los Maestros en P de V.&nbsp;<br>\n\n\n\n<br>\n\n\n\n<br>\n\n\n\nPancho Granella; Karen Rohn; Esteban Boasso; Mario Rodr&iacute;guez y Silvia Amodeo.<br>\n\n\n\n</p>\n      \n\n'),
