(391, 'aRichText', NULL, '\n\n\n\n      <p>Estas notas intentan reconstruir una charla con Silo, en octubre del 2006. No son palabras textuales.<br>Nos juntamos varios amigos en Mendoza, el d&iacute;a anterior a la ceremonia que se realiz&oacute; en Punta de Vacas, por la muerte de Kuasar Benenati.<br>Se estuvo revisando las ceremonias y procedimientos que se realizar&iacute;an el dia siguiente en el Parque., y se hicieron unos breves comentarios sobre los significados de los distintos procedimientos con las cenizas.<br>Quiz&aacute;s consideren oportunas estas reflexiones.<br>--<br>Sobre las ceremonias, se sugiri&oacute; hacerlo en un clima de mucha calma, en un tono alto y sin apuros. Tambien la importancia de un &aacute;gape al final.<br>Sobre los procedimientos se coment&oacute; sobre las diferencias entre enterrar los restos, arrojar las cenizas o dejarlas en una bandeja de acero (como se hizo en esa ocasi&oacute;n), para que el viento las fuese llevando .Dejando que las fuerzas de la naturaleza integren o diluyan los restos a su paisaje .Hay fuerzas de la naturaleza que fluyen como las aguas en los r&iacute;os, los vientos.<br>Tambi&eacute;n se sugiri&oacute; un recipiente fr&aacute;gil de cer&aacute;mica que luego de usarlo para trasladar las cenizas se rompe en la tierra para que se integre al lugar.<br>Detr&aacute;s de estas formas se va plasmando un modo de integrar o interpretar la muerte, se va expresando tambi&eacute;n una cultura.<br><br>Vemos detr&aacute;s de estas formas de proceder con los restos distintas tendencias. Una va en direcci&oacute;n de conservar y la otra busca la fluidez, la liberaci&oacute;n.<br><br>Vemos que algunos procedimientos quiz&aacute;s acompa&ntilde;en mas el significado de la ceremonia de muertes."Una vez mas la mente se libera triunfal y se abre paso hacia la luz."<br>--<br><br>Aclaraci&oacute;n: obviamente estas notas no pretenden establecer procedimientos fijos a realizar, sino mas bien reflexionar sobre esto.<br>19 de septiembre 2010, esteban boasso.<br><br>*****<br><br>Muchas gracias Esteban por las notas.<br>Quisiera agregar que en conversaciones con el Negro se trat&oacute; el tema de sus cenizas y &eacute;l, frente a la idea de repartirlas entre los distintos Parques, respondi&oacute;: "est&aacute; bueno".<br>En aquel momento imagin&eacute; las cenizas volando y una pizca de ellas, desde la Sala, debajo de la baldosa central, irradiando cual "polvo de proyecci&oacute;n", como una luz que desde el Centro Luminoso de la esfera, inspirara a quienes all&iacute; medit&aacute;ramos.<br><br>Ana Luisa.<br>Mendoza, 21 de Septiembre de 2010.</p>\n      \n\n'),
(392, 'aText', NULL, 'La Escuela: Carta del 27 de agosto de 2010'),
(393, 'aText', NULL, ''),
(394, 'aRichText', NULL, '\n\n\n\n      <p>\n\n\n\n\n\n\n\n\n\n\n\n<strong>Queridos amigos,<br>\n\n\n\n\n\n\n\n\n\n\n\n</strong>Queremos comunicarles los hitos que vienen por delante.<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nCalendario.<br>\n\n\n\n\n\n\n\n\n\n\n\n<strong>Segunda Camada.-<br>\n\n\n\n\n\n\n\n\n\n\n\n</strong>18 de septiembre:&nbsp; entrega de la segunda cuaterna<br>\n\n\n\n\n\n\n\n\n\n\n\n23 de octubre:&nbsp; entrega de la tercera cuaterna<br>\n\n\n\n\n\n\n\n\n\n\n\n4 de diciembre: postulaciones e ingresos a Escuela<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\n<strong>Cuarta Camada.-<br>\n\n\n\n\n\n\n\n\n\n\n\n</strong>11 de septiembre: segunda reuni&oacute;n de nivelaci&oacute;n<br>\n\n\n\n\n\n\n\n\n\n\n\n9 de octubre: tercera reuni&oacute;n de nivelaci&oacute;n<br>\n\n\n\n\n\n\n\n\n\n\n\n16 de octubre: &nbsp;entrega de la primera cuaterna<br>\n\n\n\n\n\n\n\n\n\n\n\n13 de noviembre: &nbsp;entrega de la segunda cuaterna<br>\n\n\n\n\n\n\n\n\n\n\n\n11 de diciembre: &nbsp;entrega de la tercera cuaterna<br>\n\n\n\n\n\n\n\n\n\n\n\n8 de enero de 2011: postulaciones e ingresos a Escuela<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\n-------------------------------------<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nEstamos en la &uacute;ltima etapa de este largo proceso de Escuela, el cual se cierra con esta cuarta camada que finaliza el 8 de enero pr&oacute;ximo. No se suma nueva gente a esta cuarta camada.<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nNo est&aacute; en nuestra mira de inter&eacute;s m&aacute;s que s&oacute;lo tres parques: Punta de Vacas, La Reja y Los Manantiales.<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nSi hay algo relevante o interesante m&aacute;s adelante en otros lados, podremos conversarlo en su momento.<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nLlevaremos el proceso de la segunda y cuarta camada solamente en estos tres parques y nos interesar&aacute; saber qui&eacute;nes son los maestros de estos tres parques.<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nDespu&eacute;s que termine la cuarta camada y se cierre todo, hablaremos de la Ascesis y otros temas.<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nNo habr&aacute; reuni&oacute;n general el 15 y 16 de enero en el Parque Punta de Vacas, ya que estamos lanzados en la autonom&iacute;a de implementaci&oacute;n, y si hay tal autonom&iacute;a no tenemos porqu&eacute; reunirnos.<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nEste comunicado va dirigido hacia las Comisiones de los parques Punta de Vacas, La Reja y Los Manantiales y al Comit&eacute; del Parque Punta de Vacas; &nbsp;y se pide difundirlo.<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nAgradeciendo&nbsp; desde ya su atenci&oacute;n, comunicamos que dejamos sin efecto los correos personales que han existido hasta ahora.<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nUn fuerte abrazo.<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nPancho, Silvia, Karen y Mario.<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nViernes 27 de agosto de 2010.</p>\n      \n\n'),
