(405, 'aText', NULL, 'Asistencia a las Reuniones de Nivelaci&oacute;n y Disciplinas'),
(406, 'aText', NULL, ''),
(407, 'aRichText', NULL, '\n\n\n\n      <p>\n\n\n\nPodr&aacute;n participar a las reuniones de la segunda y cuarta camada solamente los postulantes y disc&iacute;pulos registrados en Parque La Reja. Los listados de asistencia no est&aacute;n centralizados y los postulantes y disc&iacute;pulos registrados en otros Parques deber&aacute;n referirse a los respectivos Parques donde iniciaron su proceso.</p>\n      \n\n'),
(408, 'aText', NULL, 'Asistencia a las Reuniones de Nivelaci&oacute;n y Disciplinas'),
