(414, 'aText', NULL, 'A los Parques reconocidos por Silo al 31 de julio de 2010'),
(415, 'aText', NULL, ''),
(416, 'aRichText', NULL, '\n\n\n\n      <p>\n\n\n\nAttigliano, Italia; Banahaw, Filipinas; Carcara&ntilde;a, Argentina, Casa Giorgi, Italia; Caucaia, Brasil ; Chaco, Argentina; Hudson Valley, Estados Unidos; Kandharoli, India ; La Belle Id&eacute;e, Francia; La Reja, Argentina; Los Manantiales, Chile; La Uni&oacute;n, Colombia; Montecillo, Bolivia; Mikebuda, Hungr&iacute;a; Patagonia Norte, Argentina; Piribebuy, Paraguay; Punta de Vacas, Argentina; Toledo, Espa&ntilde;a; Red Bluff, Estados Unidos; Wiesenburg, Alemania<br>\n\n\n\n<br>\n\n\n\nQueridos Amigos:<br>\n\n\n\n<br>\n\n\n\nQuisiera expresar mi agradecimiento por todo el apoyo y el acompa&ntilde;amiento recibidos en estos momentos.<br>\n\n\n\nPodr&iacute;a describir la experiencia de esta especial circunstancia como una suerte de transferencia que sigue un proceso, vivido como una extrema tensi&oacute;n en el instante de la muerte, y que gracias al cari&ntilde;o, a las distintas ceremonias, al largo recorrido en caravana hacia el crematorio, culmina en una profunda distensi&oacute;n, cuando son entregadas sus cenizas, al experimentar que la intensidad de la tensi&oacute;n se convierte en una gran alegr&iacute;a proyectada a todo lo que nos queda por hacer.<br>\n\n\n\nSeguramente algunos no necesitan de tanto ritual para superar el tremendo dolor, y simplemente tienen un registro claro de la trascendencia. No fue as&iacute; en mi caso. As&iacute; pues, insisto en el agradecimiento a quienes me acompa&ntilde;aron.<br>\n\n\n\nConsecuentemente con mi forma de sentir, y para quienes les pueda servir de apoyo, quiero hacer llegar una peque&ntilde;a parte de sus cenizas a cada Parque de manera que, quienes as&iacute; lo deseen y en una peque&ntilde;a ceremonia, tengan la posibilidad de procesar estas im&aacute;genes cuando y del modo que consideren m&aacute;s provechoso.<br>\n\n\n\n<br>\n\n\n\n"&iquest;Ser&aacute; entonces que toda aspiraci&oacute;n, toda intenci&oacute;n, toda afirmaci&oacute;n y toda negaci&oacute;n, tienen por centro tu estado de &aacute;nimo? Podr&iacute;as replicar que aunque triste o alegre, un n&uacute;mero es siempre el mismo y que el sol es el sol, aunque no exista el ser humano.<br>\n\n\n\nYo te dir&eacute; que un n&uacute;mero es distinto a s&iacute; mismo seg&uacute;n tengas que dar o recibir, y que el sol ocupa m&aacute;s lugar en los seres humanos que en los cielos. El fulgor de una brizna encendida, o de una estrella, danza para tu ojo. As&iacute;, no hay luz sin ojo y si otro fuera el ojo distinto efecto tendr&iacute;a ese fulgor".<br>\n\n\n\n<br>\n\n\n\nDesde la Paz que me han ayudado a encontrar, Fuerza y Alegr&iacute;a para todos.<br>\n\n\n\n<br>\n\n\n\nAna Luisa<br>\n\n\n\n<br>\n\n\n\nAprovecho para hacerles llegar un gran abrazo de Alejandro y Federico.<br>\n\n\n\n<br>\n\n\n\nMendoza, 21 de Septiembre, 2010.</p>\n      \n\n'),
(417, 'aText', NULL, 'A los Parques reconocidos por Silo al 31 de julio de 2010'),
