(423, 'aText', NULL, 'Vuela hacia las estrellas el h&eacute;roe de esta edad'),
(424, 'aText', NULL, ''),
(425, 'aRichText', NULL, '\n\n\n\n      <p>\n\n\n\nQueridos Amigos:<br>\n\n\n\n<br>\n\n\n\nEl Maestro ha partido hacia el espacio infinito, "donde el tiempo es eterno y la profundidad insondable".<br>\n\n\n\n<br>\n\n\n\nEl viernes 1&deg; de octubre a partir de las 19hs nos encontraremos en Parque La Reja para recordarlo juntos y esparcir las cenizas de su cuerpo. Las ceremonias ser&aacute;n alrededor de las 20hs.<br>\n\n\n\n<br>\n\n\n\n&iexcl;Paz en el coraz&oacute;n, Luz en el entendimiento!<br>\n\n\n\n<br>\n\n\n\nComisi&oacute;n de Parque La Reja</p>\n      \n\n'),
(426, 'aSlideshow', NULL, 'a:1:{s:5:"order";a:1:{i:0;s:2:"44";}}'),
