(433, 'aText', NULL, 'Examen de Obras y Ascesis'),
(434, 'aText', NULL, ''),
(435, 'aRichText', NULL, '\n\n\n\n      <p>\n\n\n\n\n\n\n\nQueridos Amigos de las Comisiones de PPDV, La Reja y Manantiales,<br>\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\nAc&aacute; una breve nota para contarles que hay un equipo trabajando en un apunte sobre el Examen de Obras y el material sobre la Ascesis para ser entregado a todos los Maestros sin Ascesis, en forma conjunta despu&eacute;s de los ingresos a Escuela de la cuarta camada, el 8 de enero.<br>\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\nLos tiempos para esos dos hitos fueron explicados por Silo en el video &ldquo;En qu&eacute; Estamos&rdquo;. Las fechas exactas que &eacute;l mencion&oacute; - el 4 de diciembre, la explicaci&oacute;n del Examen de Obras, y fines de enero para la entrega de la Ascesis - han cambiado; sin embargo, para seguir con los ritmos de tiempo mencionados, podemos pensar que el Examen de Obras podr&iacute;a ser explicado, a todos los Maestros presentes, inmediatamente despu&eacute;s de los ingresos, el 8 de enero, y dejar de 6 a 8 semanas para realizar otra reuni&oacute;n de un d&iacute;a, a fines de febrero, para entregar la Ascesis.<br>\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\nEsperamos que esta informaci&oacute;n ayude para organizar nuestros calendarios y comunicarlos a los interesados.<br>\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\nUn gran abrazo,<br>\n\n\n\n\n\n\n\nEduardo, Mariana, Marcos y Karen<br>\n\n\n\n\n\n\n\n13 de diciembre 2010<br>\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\nPD: Lo anterior est&aacute; pensado para estos tres Parques, ya que los dem&aacute;s Parques son aut&oacute;nomos y, por lo tanto, lo podr&aacute;n tomar o no, seg&uacute;n les parezca.</p>\n      \n\n'),
(436, 'aText', NULL, 'Examen de Obras y Ascesis'),
