(439, 'aRichText', NULL, '\n\n\n\n      <p>\n</p>\n<h3>El Calendario de actividades conjuntas para el a&ntilde;o 2010 es el siguiente:</h3>\n<div><div>\n<div>Disciplina</div>\n<div><table><tbody>\n<tr>\n<td>Primera Cuaterna</td>\n<td>06/03/10</td>\n</tr>\n<tr>\n<td>Segunda Cuaterna</td>\n<td>17/04/10</td>\n</tr>\n<tr>\n<td>Tercera Cuaterna</td>\n<td>22/05/10</td>\n</tr>\n</tbody></table></div>\n</div></div>\n<p>\n&nbsp;</p>\n<h3>Tercera Reuni&oacute;n de Disc&iacute;pulos - 22 de Mayo de 2010 - Programa del D&iacute;a</h3>\n<div>\n<div>\n<div>8 hs.</div>\n<div>Registro de Asistencia &ndash; Pago de los costos de la reuni&oacute;n - Entrega de materiales.<br>\nTiempo estimado: 1 Hora&nbsp;<br>\nLugar: divisi&oacute;n en &aacute;mbitos por Disciplina&nbsp;<br>\n<ul>\n<li>\nDisciplina Material: Taller</li>\n<li>\nDisciplina Energ&eacute;tica: Multiuso</li>\n<li>\nDisciplina Mental: Centro de Estudio</li>\n<li>\nDisciplina Morfol&oacute;gica: Centro de Trabajo</li>\n</ul>\n</div>\n</div>\n<div>\n<div>9 hs.</div>\n<div>Inicio de video de la tercera cuaterna en &aacute;mbitos por Disciplina<br>\n<ul>\n<li>\nTaller</li>Disciplina Material - Tercera Cuaterna (Video)<br>\nTiempo estimado: 40 minutos<br>\n<br>\n<li>\nMultiuso</li>La Disciplina Energ&eacute;tica - Tercera Cuaterna (Video)<br>\nTiempo estimado: 30 minutos<br>\n<br>\n<li>\nCentro de Estudio</li>La Disciplina Mental - Tercera Cuaterna (Video)<br>\nTiempo estimado: 30 minutos<br>\n<br>\n<li>\nCentro de Trabajo</li>La Disciplina Morfol&oacute;gica - Tercera Cuaterna (Video)<br>\nTiempo estimado: 30 minutos<br>\n<br>\n\n</ul>\n</div>\n</div>\n<div>\n<div>10 hs.</div>\n<div>Intercambio e inicio de los Trabajos.<br>\n(Los grupos de intercambio pueden hacer uso de los distintos ambitos)<br>\nCaf&eacute; y galletas.</div>\n</div>\n<div>\n<div>13 hs.</div>\n<div>Almuerzo (provisto por los participantes). Caf&eacute;.</div>\n</div>\n<div>\n<div>17 hs.</div>\n<div>Caf&eacute; y galletas.</div>\n</div>\n<div>\n<div>20 hs.</div>\n<div>Fin de la jornada de Trabajo.</div>\n</div>\n</div>\n<p>\nAporte $80 por persona.</p>\n<p>\nInformaci&oacute;n: info@parquelareja.org</p>\n<p>\nPara reservar alojamiento en el C de T, realizarlo a trav&eacute;s de&nbsp;<a href="http://parquelareja.org/reserva.php">Reserva</a>.</p>\n      \n\n'),
