(442, 'aRichText', NULL, '\n\n\n\n      <p></p>\n<h3>El Calendario de actividades conjuntas para el a&ntilde;o 2010 es el siguiente:</h3>\n<div>\n<div>\n<div>Nivelaci&oacute;n</div>\n<div><table><tbody>\n<tr>\n<td>Primera Reuni&oacute;n</td>\n<td>20/03/10</td>\n</tr>\n<tr>\n<td>Segunda Reuni&oacute;n</td>\n<td>15/05/10</td>\n</tr>\n<tr>\n<td>Tercera Reuni&oacute;n</td>\n<td>03 y 04/07/10</td>\n</tr>\n</tbody></table></div>\n</div>\n<div>\n<div>Disciplina</div>\n<div><table><tbody>\n<tr>\n<td>Primera Cuaterna</td>\n<td>07/08/10</td>\n</tr>\n<tr>\n<td>Segunda Cuaterna</td>\n<td>18/09/10</td>\n</tr>\n<tr>\n<td>Tercera Cuaterna</td>\n<td>23/10/10</td>\n</tr>\n<tr>\n<td>Postulaciones e ingresos a Escuela</td>\n<td>04/12/2010</td>\n</tr>\n</tbody></table></div>\n</div>\n</div>\n<p>&nbsp;</p>\n<h3>Reuni&oacute;n de Postulaci&oacute;n e Ingreso a Escuela 4, 5 y 6 de diciembre 2010</h3>\n<div><div>El 4 de diciembre de 9hs a 10hs registro de asistencia.<br>A las 12 hs comenzaran las Ceremonias de Ingreso.<br><br>El 5 de diciembre desde las 10 hs Ceremonias de Ingreso.<br>A las 21hs. cena conjunta.<br><br>El 6 de diciembre desde las 12 horas encuentro conjunto.<br><br>Contribuci&oacute;n para la reuni&oacute;n: $260</div></div>\n<p>&nbsp;</p>\n<h3>Tercera Reuni&oacute;n de Disc&iacute;pulos - 23 de octubre de 2010</h3>\n<div>\n<div>\n<div>8.00 hs.</div>\n<div>Registro de Asistencia &ndash; Pago de los costos de la reuni&oacute;n &ndash; Entrega de Materiales<br>Tiempo estimado: 1 Hora. Lugar: divisi&oacute;n en &aacute;mbitos por Disciplina:<br><ul>\n<li>Disciplina Material: Taller</li>\n<li>Disciplina Energ&eacute;tica: Centro de Trabajo</li>\n<li>Disciplina Mental: Multiuso</li>\n<li>Disciplina Morfol&oacute;gica: Centro de Estudio</li>\n</ul>\n</div>\n</div>\n<div>\n<div>9.00 hs.</div>\n<div>Inicio de video de la Tercera Cuaterna en &aacute;mbitos por Disciplina<br><br>Taller<br>La Disciplina Material - Tercera Cuaterna (Video)<br>Tiempo estimado: 40 minutos<br><br>Centro de Trabajo<br>La Disciplina Energ&eacute;tica - Tercera Cuaterna (Video)<br>Tiempo estimado: 30 minutos<br><br>Multiuso<br>La Disciplina Mental - Tercera Cuaterna (Video)<br>Tiempo estimado: 30 minutos<br><br>Centro de Estudio<br>La Disciplina Morfol&oacute;gica - Tercera Cuaterna (Video)<br>Tiempo estimado: 30 minutos</div>\n</div>\n<div>\n<div>10.00 hs.</div>\n<div>Intercambio e inicio de los Trabajos. (Los grupos de intercambio pueden hacer<br>uso de los distintos &aacute;mbitos)<br>Caf&eacute; y galletas.</div>\n</div>\n<div>\n<div>13.00 hs.</div>\n<div>Almuerzo (provisto por los participantes). Caf&eacute;.</div>\n</div>\n<div>\n<div>17 hs.</div>\n<div>Caf&eacute; y galletas.</div>\n</div>\n<div>\n<div>20 hs.</div>\n<div>Limpieza y orden del &aacute;mbito<br>Fin de los trabajos.</div>\n</div>\n</div>\n<p>Contribuci&oacute;n a los gastos de la reuni&oacute;n $80.- por persona.&nbsp;<br><br>Informaci&oacute;n: info@parquelareja.org&nbsp;<br><br>Para reservas de alojamiento en el Parque dirigirse a&nbsp;<a href="http://parquelareja.org/reserva.php">parquelareja.org: Reserva</a>.</p>\n<p>&nbsp;</p>\n      \n\n'),
