(445, 'aRichText', NULL, '\n\n\n\n      <p></p>\n<div><div><div><div>\n<h3>El Calendario de actividades conjuntas para el a&ntilde;o 2010 es el siguiente:</h3>\n<div>\n<div>\n<div>Proceso de Nivelaci&oacute;n</div>\n<div><table><tbody>\n<tr>\n<td>14/08/10</td>\n<td>Primera Reuni&oacute;n</td>\n</tr>\n<tr>\n<td>11/09/10</td>\n<td>Segunda Reuni&oacute;n</td>\n</tr>\n<tr>\n<td>09/10/10</td>\n<td>Tercera Reuni&oacute;n y Presentaci&oacute;n de Las Cuatro Disciplinas</td>\n</tr>\n</tbody></table></div>\n</div>\n<div>\n<div>Proceso Disciplinario</div>\n<div><table><tbody>\n<tr>\n<td>16/10/10</td>\n<td>Primera Cuaterna</td>\n</tr>\n<tr>\n<td>13/11/10</td>\n<td>Segunda Cuaterna</td>\n</tr>\n<tr>\n<td>11/12/10</td>\n<td>Tercera Cuaterna</td>\n</tr>\n<tr>\n<td>08/01/11</td>\n<td>Postulaciones e Ingresos a Escuela</td>\n</tr>\n</tbody></table></div>\n</div>\n</div>\n<p>&nbsp;</p>\n<h3>Tercera Reuni&oacute;n de Disc&iacute;pulos - 11 de diciembre de 2010</h3>\n<div>\n<div>\n<div>8.00 hs.</div>\n<div>Registro de Asistencia &ndash; Pago de los costos de la reuni&oacute;n &ndash; Entrega de Materiales<br>Tiempo estimado: 1 Hora. Lugar: divisi&oacute;n en &aacute;mbitos por Disciplina:<br><br>Disciplina Material: Taller<br><br>Disciplina Energ&eacute;tica: Centro de Trabajo<br><br>Disciplina Mental: Multiuso<br><br>Disciplina Morfol&oacute;gica: Centro de Estudio</div>\n</div>\n<div>\n<div>9.00 hs.</div>\n<div>Inicio de video de la segunda cuaterna en &aacute;mbitos por Disciplina<br><ul>\n<li>Taller<br>Disciplina Material - Tercera Cuaterna (Video)<br>Tiempo estimado: 40 minutos</li>\n<li>Centro de Trabajo<br>La Disciplina Energ&eacute;tica - Tercera Cuaterna (Video)<br>Tiempo estimado: 30 minutos</li>\n<li>Multiuso<br>La Disciplina Mental - Tercera Cuaterna (Video)<br>Tiempo estimado: 30 minutos</li>\n<li>Centro de Estudio<br>La Disciplina Morfol&oacute;gica - Tercera Cuaterna (Video)<br>Tiempo estimado: 30 minutos</li>\n</ul>Inicio de video de la Tercera Cuaterna en &aacute;mbitos por Disciplina</div>\n</div>\n<div>\n<div>10.00 hs.</div>\n<div>Intercambio e inicio de los Trabajos.<br>Caf&eacute; y galletas.</div>\n</div>\n<div>\n<div>13.00 hs.</div>\n<div>Almuerzo (provisto por los participantes). Caf&eacute;</div>\n</div>\n<div>\n<div>17.00 hs.</div>\n<div>Caf&eacute; y galletas</div>\n</div>\n<div>\n<div>19.30 hs.</div>\n<div>Limpieza y orden del &aacute;mbito</div>\n</div>\n<div>\n<div>20 hs.</div>\n<div>Fin de la jornada de Trabajo</div>\n</div>\n</div>\n<p><br><br>Aporte de la Reuni&oacute;n $60 por persona&nbsp;<br><br>Informaci&oacute;n: info@parquelareja.org&nbsp;<br><br>Para reservas de alojamiento en el Parque dirigirse a&nbsp;<a href="http://parquelareja.org/reserva.php">parquelareja.org: Reserva</a>.<br>&nbsp;</p>\n<p>&nbsp;</p>\n</div></div></div></div>\n      \n\n'),
