(485, 'aRichText', NULL, '\n\n\n\n      <p>\n\n\n\n\n\n\n\n\n\n\n\n<i>8 de enero, registro de asistencia, solamente de 8 hs a 10 hs.<br>\n\n\n\n\n\n\n\n\n\n\n\nTerminada la  registraci&ograve;n de Postulantes y Maestros comenzaran las Ceremonias de Ingreso a  Escuela.<br>\n\n\n\n\n\n\n\n\n\n\n\n</i><i>A las 22hs. cena conjunta.</i><br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\n<i>9 de enero desde las  12 hs Reuni&oacute;n de Escuela. <br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nContribuci&oacute;n para la reuni&oacute;n: $200<br>\n\n\n\n\n\n\n\n\n\n\n\n</i></p>\n      \n\n'),
