(493, 'fSnapShot', NULL, 'a:4:{s:3:"url";N;s:5:"title";s:20:"El Centro de Estudio";s:4:"text";s:119:"Ámbito donde se desarrollan los trabajos de Escuela, donde maestros y discípulos realizan sus prácticas y estudios. ";s:5:"align";s:4:"left";}'),
(494, 'fSnapShot', NULL, 'a:4:{s:3:"url";N;s:5:"title";s:34:"La Estela o Muro de Reconocimiento";s:4:"text";s:319:"Están en ella grabados los nombres de todos quienes contribuyeron a la construcción del Parque, del mismo modo en que las antiguas estelas mesopotámicas, egipcias, sumerias o mayas, esculpidas en piedra, dejaban testimonios de los acontecimientos o hechos significativos que sucedieron al momento de ser construidas.";s:5:"align";s:4:"left";}'),
(495, 'fSnapShot', NULL, 'a:4:{s:3:"url";N;s:5:"title";s:9:"El Portal";s:4:"text";s:169:"Marca el límite entre la externalidad del mundo y la interioridad del ser humano, buscando producir un cambio en el estado interno de todo aquel que entra a este lugar.";s:5:"align";s:4:"left";}'),
