(520, 'aRichText', NULL, '\n\n\n\n      <h4>Nota para los Maestros de la 1&ordf;, 2&ordf; y 4&ordf; Camada de los 3 Parques</h4>\n<p>\n(Los Manantiales, Punta de Vacas y La Reja)&nbsp;<br>\n<br>\n En esta reuni&oacute;n que sigue a los ingresos de Escuela, vamos a facilitar una pauta de trabajo para hacer el Examen de Obra.&nbsp;<br>\n<br>\n Este Examen de Obra estimamos que pueda llevar entre 4 y 6 semanas, pasadas las cuales se estar&aacute; en condiciones de recibir las recomendaciones sobre la Ascesis.&nbsp;<br>\n<br>\n A su vez, el material sobre la Ascesis ser&aacute; entregado en una reuni&oacute;n a realizarse el s&aacute;bado 26 de febrero en los Parques, cuando dedicaremos todo el d&iacute;a al estudio, la experimentaci&oacute;n y el intercambio sobre la Ascesis.&nbsp;<br>\n<br>\n Este intercambio conviene hacerlo entre Maestros del mismo proceso, luego de la reflexi&oacute;n y experimentaci&oacute;n individual.&nbsp;<br>\n<br>\n Por los Parques La Reja, Punta de Vacas y Los Manantiales&nbsp;<br>\n Mariana, Eduardo, Karen y Marcos&nbsp;<br>\n<br>\n<br>\n Comentarios sobre el Examen de Obra hechos por Silo en reuni&oacute;n de Escuela, el 9 de enero de 2010:<br>\n<br>\n<i>"Se producir&aacute; despu&eacute;s del trabajo de la Disciplina, un Examen de Obra. Donde el sujeto mismo pone los pasos que fue haciendo, la rutina que eligi&oacute;, los tiempos que ha invertido en eso, los registros que fue teniendo. Necesitamos examinar para atr&aacute;s todo lo que pas&oacute;. Y si tuvo esa direcci&oacute;n inicial o no. Crearemos un peque&ntilde;o documento referido a esto, ese momento en que se tiene ya armada toda la Disciplina y se pretende llegar a una situaci&oacute;n nueva donde ya se puede prescindir de todo lo anterior, como si fuera el andamiaje que se utiliz&oacute; para armar toda esa situaci&oacute;n. No nos apoyaremos ya en la Disciplina. Ese dejar las cosas, nos lleva en una direcci&oacute;n muy interesante."</i>&nbsp;<br>\n<br>\n<br>\n Pauta para elaborar el Examen de Obra&nbsp;<br>\n<br>\n La presente pauta puede ayudar a realizar este examen individualmente, y luego profundizarlo mediante el intercambio con otros Maestros del mismo proceso. Se divide en dos partes, a saber:&nbsp;<br>\n<br>\n 1. Nivelaci&oacute;n&nbsp;<br>\n<br>\n Repasando todo el trabajo de nivelaci&oacute;n realizado es posible rescatar, tras los estudios del paisaje de formaci&oacute;n, biograf&iacute;a, n&uacute;cleo de ensue&ntilde;o, experiencias guiadas, la lectura de Apuntes de Psicolog&iacute;a, etc., las comprensiones m&aacute;s significativas sobre la propia existencia, con relaci&oacute;n al sin-sentido y el sentido; a la incoherencia y la coherencia; a la violencia y la no-violencia.&nbsp;<br>\n<br>\n 2. Disciplina&nbsp;<br>\n<br>\n Conforme a las anotaciones hechas durante la rutina del proceso disciplinario, se puede intentar un ordenamiento de la experiencia paso por paso, cuaterna por cuaterna y del proceso completo, considerando lo siguiente:&nbsp;<br>\n<br>\n Registros &mdash; Es decir, la vivencia que permite alcanzar la certeza definitiva y un&iacute;voca del paso en cuesti&oacute;n, para pasar al siguiente.&nbsp;<br>\n Impedimentos &mdash; Reflexionar sobre los impedimentos encontrados y las formas descubiertas para disolverlos.&nbsp;<br>\n Indicadores &mdash; Rescatar observaciones significativas sobre sue&ntilde;os, ocurrencias, estados internos y conductas.&nbsp;<br>\n Comprensiones &mdash; Aquello que en general se devela como verdad profunda, como significado esencial dador de sentido.&nbsp;<br>\n<br>\n Luego de realizar el resumen y s&iacute;ntesis de cada paso, se procede a hacer lo propio con cada cuaterna y despu&eacute;s con el proceso disciplinario completo.&nbsp;<br>\n<br>\n<br>\n Por los Parques La Reja, Punta de Vacas y Los Manantiales,&nbsp;<br>\n Mariana, Eduardo, Karen y Marcos&nbsp;</p>\n      \n\n'),
(521, 'aRichText', NULL, '\n\n\n\n      <h4>Nota para los Maestros de la 1&ordf;, 2&ordf; y 4&ordf; Camada de los 3 Parques</h4> <p>\n\n\n\n\n\n\n\n\n\n\n\n(Los Manantiales, Punta de Vacas y La Reja)&nbsp;<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\n En esta reuni&oacute;n que sigue a los ingresos de Escuela, vamos a facilitar una pauta de trabajo para hacer el Examen de Obra.&nbsp;<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\n Este Examen de Obra estimamos que pueda llevar entre 4 y 6 semanas, pasadas las cuales se estar&aacute; en condiciones de recibir las recomendaciones sobre la Ascesis.&nbsp;<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\n A su vez, el material sobre la Ascesis ser&aacute; entregado en una reuni&oacute;n a realizarse el s&aacute;bado 26 de febrero en los Parques, cuando dedicaremos todo el d&iacute;a al estudio, la experimentaci&oacute;n y el intercambio sobre la Ascesis.&nbsp;<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\n Este intercambio conviene hacerlo entre Maestros del mismo proceso, luego de la reflexi&oacute;n y experimentaci&oacute;n individual.&nbsp;<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\n Por los Parques La Reja, Punta de Vacas y Los Manantiales&nbsp;<br>\n\n\n\n\n\n\n\n\n\n\n\n Mariana, Eduardo, Karen y Marcos&nbsp;</p>\n      \n\n'),
(522, 'aRichText', NULL, '\n\n\n\n      <h4>Comentarios sobre el Examen de Obra hechos por Silo en reuni&oacute;n de Escuela, el 9 de enero de 2010:</h4>\n<p>\n\n\n\n\n\n\n\n\n\n\n\n&nbsp;</p>\n<p>\n\n\n\n\n\n\n\n\n\n\n\n<i>"Se producir&aacute; despu&eacute;s del trabajo de la Disciplina, un Examen de Obra. Donde el sujeto mismo pone los pasos que fue haciendo, la rutina que eligi&oacute;, los tiempos que ha invertido en eso, los registros que fue teniendo. Necesitamos examinar para atr&aacute;s todo lo que pas&oacute;. Y si tuvo esa direcci&oacute;n inicial o no. Crearemos un peque&ntilde;o documento referido a esto, ese momento en que se tiene ya armada toda la Disciplina y se pretende llegar a una situaci&oacute;n nueva donde ya se puede prescindir de todo lo anterior, como si fuera el andamiaje que se utiliz&oacute; para armar toda esa situaci&oacute;n. No nos apoyaremos ya en la Disciplina. Ese dejar las cosas, nos lleva en una direcci&oacute;n muy interesante."</i>&nbsp;<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nPauta para elaborar el Examen de Obra&nbsp;<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nLa presente pauta puede ayudar a realizar este examen individualmente, y luego profundizarlo mediante el intercambio con otros Maestros del mismo proceso. Se divide en dos partes, a saber:&nbsp;<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\n1. Nivelaci&oacute;n&nbsp;<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nRepasando todo el trabajo de nivelaci&oacute;n realizado es posible rescatar, tras los estudios del paisaje de formaci&oacute;n, biograf&iacute;a, n&uacute;cleo de ensue&ntilde;o, experiencias guiadas, la lectura de Apuntes de Psicolog&iacute;a, etc., las comprensiones m&aacute;s significativas sobre la propia existencia, con relaci&oacute;n al sin-sentido y el sentido; a la incoherencia y la coherencia; a la violencia y la no-violencia.&nbsp;<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\n2. Disciplina&nbsp;<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nConforme a las anotaciones hechas durante la rutina del proceso disciplinario, se puede intentar un ordenamiento de la experiencia paso por paso, cuaterna por cuaterna y del proceso completo, considerando lo siguiente:&nbsp;<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nRegistros &mdash; Es decir, la vivencia que permite alcanzar la certeza definitiva y un&iacute;voca del paso en cuesti&oacute;n, para pasar al siguiente.&nbsp;<br>\n\n\n\n\n\n\n\n\n\n\n\nImpedimentos &mdash; Reflexionar sobre los impedimentos encontrados y las formas descubiertas para disolverlos.&nbsp;<br>\n\n\n\n\n\n\n\n\n\n\n\nIndicadores &mdash; Rescatar observaciones significativas sobre sue&ntilde;os, ocurrencias, estados internos y conductas.&nbsp;<br>\n\n\n\n\n\n\n\n\n\n\n\nComprensiones &mdash; Aquello que en general se devela como verdad profunda, como significado esencial dador de sentido.&nbsp;<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nLuego de realizar el resumen y s&iacute;ntesis de cada paso, se procede a hacer lo propio con cada cuaterna y despu&eacute;s con el proceso disciplinario completo.&nbsp;<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\n<br>\n\n\n\n\n\n\n\n\n\n\n\nPor los Parques La Reja, Punta de Vacas y Los Manantiales,&nbsp;<br>\n\n\n\n\n\n\n\n\n\n\n\nMariana, Eduardo, Karen y Marcos&nbsp;</p>\n      \n\n'),
