(587, 'aRichText', NULL, '\n\n      <h3>Qu&eacute; son estos Parques?</h3>  <p>Son espacios abiertos al Estudio y Reflexi&oacute;n, para profundizar en nosotros mismos y favorecer la no-discriminaci&oacute;n, el afecto y la reciprocidad en el trato a los dem&aacute;s.</p> <p>Aspiramos a que desde ellos surja una verdadera oleada de buenos sentimientos que ayuden a develar lo Sagrado en uno y fuera de uno, permiti&eacute;ndonos comprender que no estamos solos en este mundo ni en los infinitos mundos.</p> <p>Conozca los Parques de Estudio y Reflexi&oacute;n &nbsp;a trav&eacute;s de este video.&nbsp;</p>\n      \n'),
