(618, 'fSnapShot', NULL, 'a:4:{s:3:"url";N;s:5:"title";s:34:"La Estela o Muro de Reconocimiento";s:4:"text";s:319:"Están en ella grabados los nombres de todos quienes contribuyeron a la construcción del Parque, del mismo modo en que las antiguas estelas mesopotámicas, egipcias, sumerias o mayas, esculpidas en piedra, dejaban testimonios de los acontecimientos o hechos significativos que sucedieron al momento de ser construidas.";s:5:"align";s:4:"left";}'),
