(649, 'aRichText', NULL, '\n\n      <h3>&nbsp;Como llegar?</h3><p>\n&nbsp;1) En auto:</p><div>Para llegar al lugar desde Capital Federal en auto, tomamos el ACCESO OESTE&nbsp;(Av. Gaona, Autopista del Oeste), hasta el Km. 38 donde ingresamos en la salida&nbsp;indicada como LA REJA.</div><div>&bull; Cruzamos la autopista por el puente y seguimos derecho por esa calle en la&nbsp;que desemboca (llamada Rold&aacute;n).</div><div>&bull; Bordeando el Cementerio por todo su per&iacute;metro cuando doblamos a la&nbsp;derecha ingresamos a la calle C. Larralde.</div><div>&bull; Seguimos una cuadra luego del Cementerio, hasta llegar a la Av. Alfonsina&nbsp;Storni. Desde all&iacute; son 6 cuadras derecho.</div><div>2) En tren (TBA &ndash; ex Sarmiento)</div><div>Desde Plaza Once (en Capital Federal), estaci&oacute;n Miserere, hasta estaci&oacute;n&nbsp;Moreno, hay trenes cada 5 minutos. Tiempo de viaje: 1 hora. Desde Moreno se</div><div>puede empalmar con el ramal que contin&uacute;a hasta estaci&oacute;n La Reja, pero tiene&nbsp;poca frecuencia y con numerosas demoras. Se puede tomar cualquier l&iacute;nea de&nbsp;colectivo 311 (La Perlita) desde Moreno hasta La Reja (son 5 a 7 minutos de viaje,&nbsp;ya que son unas 25 a 30 cuadras).</div><div>Desde la estaci&oacute;n La Reja son 250 mts. hasta El Parque (a la derecha, sin cruzar&nbsp;las v&iacute;as del tren).</div><div>3) En colectivo (l&iacute;nea 57, Transportes Atl&aacute;ntida)</div><div>Desde Capital Federal sale de Plaza Miserere un r&aacute;pido y tambi&eacute;n de Plaza Italia&nbsp;(de la puerta de la Rural), conviene tomar el que va por Gaona hasta la estaci&oacute;n&nbsp;Moreno. De all&iacute; tomar el colectivo La Perlita hasta estaci&oacute;n La Reja. Desde la&nbsp;estaci&oacute;n La Reja son 250 mts. (hacia la derecha, sin cruzar las v&iacute;as).</div>\n      \n'),
(650, 'aRichText', NULL, '\n\n      <h3>&nbsp;Como llegar?</h3>\n<p>\n&nbsp;1) En auto:</p>\nPara llegar al lugar desde Capital Federal en auto, tomamos el ACCESO OESTE&nbsp;(Av. Gaona, Autopista del Oeste), hasta el Km. 38 donde ingresamos en la salida&nbsp;indicada como LA REJA.\n&bull; Cruzamos la autopista por el puente y seguimos derecho por esa calle en la&nbsp;que desemboca (llamada Rold&aacute;n).\n&bull; Bordeando el Cementerio por todo su per&iacute;metro cuando doblamos a la&nbsp;derecha ingresamos a la calle C. Larralde.\n&bull; Seguimos una cuadra luego del Cementerio, hasta llegar a la Av. Alfonsina&nbsp;Storni. Desde all&iacute; son 6 cuadras derecho.\n2) En tren (TBA &ndash; ex Sarmiento)\nDesde Plaza Once (en Capital Federal), estaci&oacute;n Miserere, hasta estaci&oacute;n&nbsp;Moreno, hay trenes cada 5 minutos. Tiempo de viaje: 1 hora. Desde Moreno se puede empalmar con el ramal que contin&uacute;a hasta estaci&oacute;n La Reja, pero tiene&nbsp;poca frecuencia y con numerosas demoras. Se puede tomar cualquier l&iacute;nea de&nbsp;colectivo 311 (La Perlita) desde Moreno hasta La Reja (son 5 a 7 minutos de viaje,&nbsp;ya que son unas 25 a 30 cuadras).\nDesde la estaci&oacute;n La Reja son 250 mts. hasta El Parque (a la derecha, sin cruzar&nbsp;las v&iacute;as del tren).\n3) En colectivo (l&iacute;nea 57, Transportes Atl&aacute;ntida)\nDesde Capital Federal sale de Plaza Miserere un r&aacute;pido y tambi&eacute;n de Plaza Italia&nbsp;(de la puerta de la Rural), conviene tomar el que va por Gaona hasta la estaci&oacute;n&nbsp;Moreno. De all&iacute; tomar el colectivo La Perlita hasta estaci&oacute;n La Reja. Desde la&nbsp;estaci&oacute;n La Reja son 250 mts. (hacia la derecha, sin cruzar las v&iacute;as).\n      \n'),
