(1047, 'aText', NULL, 'Celebracion Estacional'),
(1048, 'aText', NULL, 'Uso de Instalaciones'),
(1049, 'aRichText', NULL, '<p><strong>&iexcl;Bienvenidos a nuestro Parque!</strong></p><br /><p>El uso de sus instalaciones est&aacute; destinado primordialmente a reuniones, retiros y seminarios de</p><p>estudio y reflexi&oacute;n. .</p><p>Este breve instructivo incluye la informaci&oacute;n necesaria para quienes hagan uso de las</p><p>instalaciones del Parque. Toda otra consulta puede hacerse a info@parquelareja.org</p><p>El Parque, la Multiuso y la Sala: Se mantienen abiertos de 10.00 a 19.00 hs. horario de</p><p>invierno y de 10.00 a 21.00 Hs, horario de verano.</p><p>Multiuso: Cuenta con 12 mesas y 48 sillas, no es de uso exclusivo, no se reserva, pero s&iacute; se</p><p>puede anunciar el uso en la web para que se coordinen las distintas actividades que pudieran</p><p>realizarse all&iacute;. Hay un espacio destinado al autoservicio, con microondas, cafeteras y termos.</p><p>Taller: para su reserva y uso ver instructivo espec&iacute;fico.</p><p>Centro de Trabajo: Es el &aacute;mbito donde miembros del Movimiento Humanista y de sus</p><p>organismos y los amigos de El Mensaje de Silo realizan seminarios y retiros. La capacidad total</p><p>de alojamiento es de 15 personas, cinco (5) por habitaci&oacute;n como m&aacute;ximo.</p><p>Cuenta tambi&eacute;n con un sal&oacute;n/estar con capacidad para 250 personas sentadas o 100</p><p>distribuidas en mesas. Es conveniente que quienes reserven el sal&oacute;n del C de T informen el</p><p>n&uacute;mero de mesas y sillas requeridas.</p><p>Centro de Estudio: Es el &aacute;mbito de Escuela donde los Maestros realizan sus trabajos y</p><p>estudios. La capacidad total de alojamiento es de 16 personas.</p><p>Cuenta tambi&eacute;n con un sal&oacute;n central con capacidad para 60 personas; una salita de reuni&oacute;n/</p><p>escritorio y un desayunador.</p><p>En ambos Centros, las cocinas equipadas cuentan, adem&aacute;s, con microondas, termos, ollas,</p><p>sartenes y vajilla. Los salones cuentan con mesas y sillas. Las habitaciones disponen de</p><p>s&aacute;banas, toallones, toallas, mantas y acolchados para cada persona.</p><p>Estacionamiento: el acceso para el Centro de Trabajo es por el port&oacute;n de Alfonsina</p><p>Storni, al lado de ese Centro. Para el Centro de Estudios el estacionamiento tiene su ingreso</p><p>por la calle Rocha Blaquier.</p><p>Internet: todos los &aacute;mbitos tienen WiFi.</p><p>Reservas Centro de Trabajo y Centro de Estudios</p><p>Las reservas se hacen por la Web: www.parquelareja.org en la pestana &ldquo;Reserva&rdquo;,</p><p>completando los datos del formulario que llegar&aacute; al equipo que coordina esto, quienes, a</p><p>vuelta de correo, confirmaran la misma enviando los particulares. Se tendr&aacute; en cuenta el orden</p><p>de llegada de los pedidos de reserva.</p><p>Se puede consultar la pestana &ldquo;Calendario de uso&rdquo; para ver la disponibilidad de los Centros.</p><p>En el caso que las habitaciones no se ocupen en su totalidad por un grupo, las camas libres</p><p>quedar&aacute;n disponibles para otras reservas y no se tendr&aacute; uso exclusivo de los salones de los</p><p>respectivos Centros.</p><p>Horario de ingreso y egreso</p><p>Cuando se reserva cualquiera de los Centros, el horario de ingreso a las habitaciones es a las</p><p>18 hs. y el de salida a las 18.00 Hs. del d&iacute;a siguiente.</p><p>Si la reserva es por el d&iacute;a, sin uso de habitaciones, el horario de entrada es a las 10hs y el de</p><p>salida a las 20.00 Hs.</p><p>Al llegar y retirarse, por favor, avisar al cuidador.</p><p>Breves consideraciones de uso</p><p>Al llegar:</p><p>La persona responsable recibe un juego de llaves, compuesto por las llaves de las</p><p>habitaciones, la del Centro de Trabajo o Estudio y la de una puerta de la Sala.</p><p>Al final del d&iacute;a:</p><p>Una persona del grupo tendr&iacute;a que verificar que est&eacute;n cerradas con llave las puertas, incluida</p><p>la de la Sala (cada Centro tiene una llave diferente) y el port&oacute;n de ingreso vehicular.</p><p>Se apagan las luces interiores, dejando encendidas las luces exteriores. Se baja la temperatura</p><p>o se apagan las estufas, incluidas las de la Sala. Se verifica que las llaves de paso del gas</p><p>est&eacute;n cerradas, tambi&eacute;n la de la cocina.</p><p>Al retirarse:</p><p>Verificar que no queden canillas abiertas, p&eacute;rdidas de inodoro, luces encendidas, estufas</p><p>el&eacute;ctricas enchufadas y de gas apagadas y llaves de paso cerradas.</p><p>Las toallas se pueden depositar en los cestos en las habitaciones y las sabanas sobre la cama.</p><p>Se entrega le juego de llaves.</p><p>Con reserva de comida:</p><p>El personal de cocina, es un servicio terciarizado, s&oacute;lo se dedica a preparar las comidas y se</p><p>retira. Para facilitar su tarea, en el CdT se solicita utilizar la bacha de la izquierda.</p><p>Sin reserva de comida:</p><p>Es posible cocinar, cuando el personal de servicio no est&eacute; utilizando la cocina, dejando todo en</p><p>el mismo estado que se lo encontr&oacute;.</p><p>Si surgiera alg&uacute;n desperfecto o emergencia, avisar al cuidador del Parque.</p><p>Si surgiera alguna emergencia m&eacute;dica, contactar con el servicio Vital.(tel: 4000 8888 / 4556</p><p>4556 - Cliente N&ordm; 862947.</p><p>Por favor, retirar los bolsos de las habitaciones antes de las 17.30 hs para permitir su limpieza.</p><p>Muchas gracias</p><p>Comisi&oacute;n de Parque La Reja</p><p>Web: www.parquelareja.org</p>'),
(1050, 'aRichText', NULL, '<h4><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&iexcl;Bienvenidos a nuestro Parque!</strong></h4><h4>&nbsp;</h4><p>El uso de sus instalaciones est&aacute; destinado primordialmente a reuniones, retiros y seminarios de</p><h4>estudio y reflexi&oacute;n. .</h4><h4>Este breve instructivo incluye la informaci&oacute;n necesaria para quienes hagan uso de las</h4><h4>instalaciones del Parque. Toda otra consulta puede hacerse a info@parquelareja.org</h4><h4>El Parque, la Multiuso y la Sala: Se mantienen abiertos de 10.00 a 19.00 hs. horario de</h4><h4>invierno y de 10.00 a 21.00 Hs, horario de verano.</h4><h4>Multiuso: Cuenta con 12 mesas y 48 sillas, no es de uso exclusivo, no se reserva, pero s&iacute; se</h4><h4>puede anunciar el uso en la web para que se coordinen las distintas actividades que pudieran</h4><h4>realizarse all&iacute;. Hay un espacio destinado al autoservicio, con microondas, cafeteras y termos.</h4><h4>Taller: para su reserva y uso ver instructivo espec&iacute;fico.</h4><h4>Centro de Trabajo: Es el &aacute;mbito donde miembros del Movimiento Humanista y de sus</h4><h4>organismos y los amigos de El Mensaje de Silo realizan seminarios y retiros. La capacidad total</h4><h4>de alojamiento es de 15 personas, cinco (5) por habitaci&oacute;n como m&aacute;ximo.</h4><h4>Cuenta tambi&eacute;n con un sal&oacute;n/estar con capacidad para 250 personas sentadas o 100</h4><h4>distribuidas en mesas. Es conveniente que quienes reserven el sal&oacute;n del C de T informen el</h4><h4>n&uacute;mero de mesas y sillas requeridas.</h4><h4>Centro de Estudio: Es el &aacute;mbito de Escuela donde los Maestros realizan sus trabajos y</h4><h4>estudios. La capacidad total de alojamiento es de 16 personas.</h4><h4>Cuenta tambi&eacute;n con un sal&oacute;n central con capacidad para 60 personas; una salita de reuni&oacute;n/</h4><h4>escritorio y un desayunador.</h4><h4>En ambos Centros, las cocinas equipadas cuentan, adem&aacute;s, con microondas, termos, ollas,</h4><h4>sartenes y vajilla. Los salones cuentan con mesas y sillas. Las habitaciones disponen de</h4><h4>s&aacute;banas, toallones, toallas, mantas y acolchados para cada persona.</h4><h4>Estacionamiento: el acceso para el Centro de Trabajo es por el port&oacute;n de Alfonsina</h4><h4>Storni, al lado de ese Centro. Para el Centro de Estudios el estacionamiento tiene su ingreso</h4><h4>por la calle Rocha Blaquier.</h4><h4>Internet: todos los &aacute;mbitos tienen WiFi.</h4><h4>Reservas Centro de Trabajo y Centro de Estudios</h4><h4>Las reservas se hacen por la Web: www.parquelareja.org en la pestana &ldquo;Reserva&rdquo;,</h4><h4>completando los datos del formulario que llegar&aacute; al equipo que coordina esto, quienes, a</h4><h4>vuelta de correo, confirmaran la misma enviando los particulares. Se tendr&aacute; en cuenta el orden</h4><h4>de llegada de los pedidos de reserva.</h4><h4>Se puede consultar la pestana &ldquo;Calendario de uso&rdquo; para ver la disponibilidad de los Centros.</h4><h4>En el caso que las habitaciones no se ocupen en su totalidad por un grupo, las camas libres</h4><h4>quedar&aacute;n disponibles para otras reservas y no se tendr&aacute; uso exclusivo de los salones de los</h4><h4>respectivos Centros.</h4><h4>Horario de ingreso y egreso</h4><h4>Cuando se reserva cualquiera de los Centros, el horario de ingreso a las habitaciones es a las</h4><h4>18 hs. y el de salida a las 18.00 Hs. del d&iacute;a siguiente.</h4><h4>Si la reserva es por el d&iacute;a, sin uso de habitaciones, el horario de entrada es a las 10hs y el de</h4><h4>salida a las 20.00 Hs.</h4><h4>Al llegar y retirarse, por favor, avisar al cuidador.</h4><h4>Breves consideraciones de uso</h4><h4>Al llegar:</h4><h4>La persona responsable recibe un juego de llaves, compuesto por las llaves de las</h4><h4>habitaciones, la del Centro de Trabajo o Estudio y la de una puerta de la Sala.</h4><h4>Al final del d&iacute;a:</h4><h4>Una persona del grupo tendr&iacute;a que verificar que est&eacute;n cerradas con llave las puertas, incluida</h4><h4>la de la Sala (cada Centro tiene una llave diferente) y el port&oacute;n de ingreso vehicular.</h4><h4>Se apagan las luces interiores, dejando encendidas las luces exteriores. Se baja la temperatura</h4><h4>o se apagan las estufas, incluidas las de la Sala. Se verifica que las llaves de paso del gas</h4><h4>est&eacute;n cerradas, tambi&eacute;n la de la cocina.</h4><h4>Al retirarse:</h4><h4>Verificar que no queden canillas abiertas, p&eacute;rdidas de inodoro, luces encendidas, estufas</h4><h4>el&eacute;ctricas enchufadas y de gas apagadas y llaves de paso cerradas.</h4><h4>Las toallas se pueden depositar en los cestos en las habitaciones y las sabanas sobre la cama.</h4><h4>Se entrega le juego de llaves.</h4><h4>Con reserva de comida:</h4><h4>El personal de cocina, es un servicio terciarizado, s&oacute;lo se dedica a preparar las comidas y se</h4><h4>retira. Para facilitar su tarea, en el CdT se solicita utilizar la bacha de la izquierda.</h4><h4>Sin reserva de comida:</h4><h4>Es posible cocinar, cuando el personal de servicio no est&eacute; utilizando la cocina, dejando todo en</h4><h4>el mismo estado que se lo encontr&oacute;.</h4><h4>Si surgiera alg&uacute;n desperfecto o emergencia, avisar al cuidador del Parque.</h4><h4>Si surgiera alguna emergencia m&eacute;dica, contactar con el servicio Vital.(tel: 4000 8888 / 4556</h4><h4>4556 - Cliente N&ordm; 862947.</h4><h4>Por favor, retirar los bolsos de las habitaciones antes de las 17.30 hs para permitir su limpieza.</h4><h4>Muchas gracias</h4><h4>Comisi&oacute;n de Parque La Reja</h4><h4>Web: www.parquelareja.org</h4>'),
