(1289, 'aRichText', NULL, '<h6>El inter&eacute;s de estos trabajos de nivelaci&oacute;n apunta a lograr uniformidad b&aacute;sica de comprensi&oacute;n y lenguaje entre todos los participantes. Son Trabajos para superar el sufrimiento y la violencia interna.</h6><h6><br />Para acceder al trabajo con una Disciplina, se requiere de una mente calma, atenta y sin grandes ruidos. A este estado interno apuntan los trabajos de Nivelaci&oacute;n</h6><h6>&nbsp;</h6><h6>Estos trabajos se realizan sin instructores.<br /><br />El intercambio de experiencias, dificultades, descubrimientos, realizados con otros participantes en situaci&oacute;n de paridad, acelera los tiempos de transformaci&oacute;n personal.</h6><h6>&nbsp;</h6><h6>CONTACTO:&nbsp;<a href="http://nivelacion2012.blogspot.com/" target="_blank">http://nivelacion2012.blogspot.com/</a>&nbsp;</h6>'),
(1290, 'aRichText', NULL, '<h6>El inter&eacute;s de estos trabajos de nivelaci&oacute;n apunta a lograr uniformidad b&aacute;sica de comprensi&oacute;n y lenguaje entre todos los participantes. Son Trabajos para superar el sufrimiento y la violencia interna.</h6><h6><br />Para acceder al trabajo con una Disciplina, se requiere de una mente calma, atenta y sin grandes ruidos. A este estado interno apuntan los trabajos de Nivelaci&oacute;n</h6><h6>&nbsp;</h6><h6>Estos trabajos se realizan sin instructores.<br /><br />El intercambio de experiencias, dificultades, descubrimientos, realizados con otros participantes en situaci&oacute;n de paridad, acelera los tiempos de transformaci&oacute;n personal.</h6><h6>&nbsp;</h6>'),
