(1381, 'aRichText', NULL, '<h4>Presentaci&oacute;n de Monograf&iacute;as: 13 hs. Tito de Casas - La relaci&oacute;n del Buen Conocimiento y Aura Mazda..</h4><p>18 hs. Transmisi&oacute;n en vivo "Las 4 v&iacute;as de predisposici&oacute;n a la adivinaci&oacute;n. Cluadie Baudoin.</p><br />'),
(1382, 'aRichText', NULL, '<h4>13 hs .Presentaci&oacute;n Tito de Casas - La relaci&oacute;n del Buen Conocimiento y Aura Mazda-Zoroastro</h4><p><strong>18 hs. Transmisi&oacute;n en vivo "Las 4 v&iacute;as de predisposici&oacute;n a la adivinaci&oacute;n. Cluadie Baudoin.</strong></p><br />'),
(1383, 'aText', NULL, '18 hs. Transmisi&oacute;n en vivo &quot;Las 4 v&iacute;as de predisposici&oacute;n a la adivinaci&oacute;n. Cluadie Baudoin'),
(1384, 'aRichText', NULL, '<p>Este s&aacute;bado 28 de Abril se transmitir&aacute; en vivo desde el Parque Carcara&ntilde;&aacute; la presentaci&oacute;n de Claudie Baudoin sobre su monografia "4 v&iacute;as de predispoci&oacute;n a la adivinaci&oacute;n". La transmisi&oacute;n se ver&aacute; a trav&eacute;s de&nbsp;<a href="http://www.ustream.tv/channel/parquecarcarana" target="_blank">http://www.ustream.tv/channel/parquecarcarana</a>&nbsp;a las 18hs.&nbsp;Se proyectar&aacute; en el Sal&oacute;n Multiuso.&nbsp;</p>'),
(1385, 'aText', NULL, '18 hs. Transmisi&oacute;n en vivo &quot;Las 4 v&iacute;as de predisposici&oacute;n a la adivinaci&oacute;n. Cluadie Baudoin'),
