(1405, 'aRichText', NULL, '<h4>S&aacute;bado 19/5 - 15 &nbsp;hs. Reuni&oacute;n voluntarios reemplazo franco del casero</h4><br />'),
(1406, 'aRichText', NULL, '<p>Trabajos de nivelaci&oacute;n  - Iniciativa de Grupo de Maestros:&nbsp;<i>Hernan Daulte, Edgardo Perez, Manuel Fuertes, Alejandro Roger, Gustavo Schierff, Alexis Camillieri, Alberto Falabella.</i></p><p>Informaci&oacute;n: 2012nivelacion@gmail.com</p><p>El inter&eacute;s de estos trabajos de nivelaci&oacute;n apunta a lograr uniformidad b&aacute;sica de comprensi&oacute;n y lenguaje entre todos los participantes. Son Trabajos para superar el sufrimiento y la violencia interna.  Para acceder al trabajo con una Disciplina, se requiere de una mente calma, atenta y sin grandes ruidos. A este estado interno apuntan los trabajos de Nivelaci&oacute;n   Estos trabajos se realizan sin instructores.</p><p>El intercambio de experiencias, dificultades, descubrimientos, realizados con otros participantes en situaci&oacute;n de paridad, acelera los tiempos de transformaci&oacute;n personal.</p>'),
