(1459, 'aRichText', NULL, '<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong> &nbsp;<strong>&iexcl;Bienvenidos a nuestro Parque!</strong></p><br /><p>El uso de sus instalaciones est&aacute; destinado primordialmente a reuniones, retiros y seminarios de</p><p>estudio y reflexi&oacute;n. .</p><p>Este breve instructivo incluye la informaci&oacute;n necesaria para quienes hagan uso de las</p><p>instalaciones del Parque. Toda otra consulta puede hacerse a info@parquelareja.org</p><br /><p><strong>Horario de El Parque :</strong>&nbsp;de Lunes a Viernes &nbsp;09.00 a 12 hs y de 14 a 19.00 hs. S&aacute;bados, Domingos y Feriados de 10 a 20 hs.&nbsp;</p><br /><p><strong>Multiuso: </strong>Cuenta con 12 mesas y 48 sillas, no es de uso exclusivo, no se reserva, pero s&iacute; se</p><p>puede anunciar el uso en la web para que se coordinen las distintas actividades que pudieran</p><p>realizarse all&iacute;. Hay un espacio destinado al autoservicio, con microondas, cafeteras y termos.</p><br /><p><strong>Taller: </strong>para su reserva y uso ver instructivo espec&iacute;fico (en la pesta&ntilde;a "Reserva").</p><br /><p><strong>Centro de Trabajo: </strong>Es el &aacute;mbito donde miembros del Movimiento Humanista y de sus</p><p>organismos y los amigos de El Mensaje de Silo realizan seminarios y retiros. La capacidad total</p><p>de alojamiento es de 15 personas, cinco (5) por habitaci&oacute;n como m&aacute;ximo.</p><p>Cuenta tambi&eacute;n con un sal&oacute;n/estar con capacidad para 250 personas sentadas o 100</p><p>distribuidas en mesas. Es conveniente que quienes reserven el sal&oacute;n del C de T informen el</p><p>n&uacute;mero de mesas y sillas requeridas.</p><br /><p><strong>Centro de Estudio:</strong> Es el &aacute;mbito de Escuela donde los Maestros realizan sus trabajos y</p><p>estudios. La capacidad total de alojamiento es de 16 personas.</p><p>Cuenta tambi&eacute;n con un sal&oacute;n central con capacidad para 60 personas; una salita de reuni&oacute;n/</p><p>escritorio y un desayunador.</p><br /><p>En ambos Centros, las cocinas equipadas cuentan, adem&aacute;s, con microondas, termos, ollas,</p><p>sartenes y vajilla. Los salones cuentan con mesas y sillas. Las habitaciones disponen de</p><p>s&aacute;banas, toallones, toallas, mantas y acolchados para cada persona.</p><br /><p><strong>Estacionamiento:</strong> el acceso para el Centro de Trabajo es por el port&oacute;n de Alfonsina</p><p>Storni, al lado de ese Centro. Para el Centro de Estudios el estacionamiento tiene su ingreso</p><p>por la calle Rocha Blaquier.</p><br /><p><strong>Internet:</strong> todos los &aacute;mbitos tienen WiFi.</p><br /><p><strong>Reservas Centro de Trabajo y Centro de Estudios</strong></p><p>Las reservas se hacen por la Web: www.parquelareja.org en la pestana<strong> &ldquo;Reserva&rdquo;,</strong></p><p>completando los datos del formulario que llegar&aacute; al equipo que coordina esto, quienes, a</p><p>vuelta de correo, confirmaran la misma enviando los particulares. Se tendr&aacute; en cuenta el orden</p><p>de llegada de los pedidos de reserva.</p><p>Se puede consultar la pestana<strong> &ldquo;Calendario de uso&rdquo; </strong>para ver la disponibilidad de los Centros.</p><p>En el caso que las habitaciones no se ocupen en su totalidad por un grupo, las camas libres</p><p>quedar&aacute;n disponibles para otras reservas y no se tendr&aacute; uso exclusivo de los salones de los</p><p>respectivos Centros.</p><br /><p><strong>Horario de ingreso y egreso</strong></p><p>Cuando se reserva cualquiera de los Centros, el horario de ingreso a las habitaciones es a las</p><p>18 hs. y el de salida a las 18.00 Hs. del d&iacute;a siguiente.</p><p>Si la reserva es por el d&iacute;a, sin uso de habitaciones, el horario de entrada es a las 10hs y el de</p><p>salida a las 20.00 Hs.</p><p>Al llegar y retirarse, por favor, avisar al cuidador.</p><br /><p><strong>Breves consideraciones de uso</strong></p><p><strong>Al llegar:</strong></p><p>La persona responsable recibe un juego de llaves, compuesto por las llaves de las</p><p>habitaciones, la del Centro de Trabajo o Estudio y la de una puerta de la Sala.</p><p><strong>Al final del d&iacute;a:</strong></p><p>Una persona del grupo tendr&iacute;a que verificar que est&eacute;n cerradas con llave las puertas, incluida</p><p>la de la Sala (cada Centro tiene una llave diferente) y el port&oacute;n de ingreso vehicular.</p><p>Se apagan las luces interiores, dejando encendidas las luces exteriores. Se baja la temperatura</p><p>o se apagan las estufas, incluidas las de la Sala. Se verifica que las llaves de paso del gas</p><p>est&eacute;n cerradas, tambi&eacute;n la de la cocina.</p><p><strong>Al retirarse:</strong></p><p>Verificar que no queden canillas abiertas, p&eacute;rdidas de inodoro, luces encendidas, estufas</p><p>el&eacute;ctricas enchufadas y de gas apagadas y llaves de paso cerradas.</p><p>Las toallas se pueden depositar en los cestos en las habitaciones y las sabanas sobre la cama.</p><p>Se entrega el juego de llaves.</p><br /><p>Es posible cocinar en los Centros, dejando todo en&nbsp;el mismo estado que se lo encontr&oacute;.</p><p>Si surgiera alg&uacute;n desperfecto o emergencia, avisar al cuidador del Parque.</p><p>Si surgiera alguna emergencia m&eacute;dica, contactar con el servicio Vital.(tel: 4000 8888 / 4556</p><p>4556 - Cliente N&ordm; 862947.</p><p>Por favor, retirar los bolsos de las habitaciones antes de las 17.30 hs para permitir su limpieza.</p><br /><p>Muchas gracias</p><p>Comisi&oacute;n de Parque La Reja</p><br />'),
