(1604, 'aRichText', NULL, '<div><em><strong>Victor Piccinini</strong></em></div><ul><li><a href="http://www.parquelareja.org/uploads/media_items/el-transcurrir.original.pdf">El trascurrir</a>&nbsp;(&nbsp;<a href="http://www.parquelareja.org/uploads/media_items/el-transcurrir.original.pdf">ESP</a>&nbsp;-&nbsp;<a href="http://www.parquelareja.org/uploads/media_items/il-trascorrere-ita.original.pdf">ITA&nbsp;</a>&nbsp;- <a href="http://www.parquelareja.org/uploads/media_items/l-%C3%A9coulement-du-temps-fr.original.pdf">FRA</a>&nbsp;)<b><br /></b></li><li><a href="http://www.parquelareja.org/uploads/media_items/la-experiencia-del-tiempo-julio2011-2.original.pdf">La Experiencia del Tiempo</a>&nbsp;(&nbsp;<a href="http://www.parquelareja.org/uploads/media_items/la-experiencia-del-tiempo-julio2011-2.original.pdf">ESP</a>&nbsp;-&nbsp;<a href="http://www.parquelareja.org/uploads/media_items/l-esperienza-del-tempo-luglio2011.original.pdf">ITA</a>&nbsp;-&nbsp;<a href="http://www.parquelareja.org/uploads/media_items/l-exp%C3%A9riencedu-temp-fr.original.pdf">FRA</a>&nbsp;)</li> </ul><br />'),
