(1742, 'aRichText', NULL, '<h4>La Sala</h4>\n<p>Su interior simboliza el acceso a la experiencia interna profunda a  trav&eacute;s de un espacio semiesf&eacute;rico vac&iacute;o de &iacute;conos, s&iacute;mbolos o im&aacute;genes.  Exteriormente, los muros hacen de enmarque de una esfera, que en su  c&uacute;spide indica la direcci&oacute;n hacia lo alto.</p>'),
