(1749, 'aRichText', NULL, '<div>\n<h4>El Centro de Estudio</h4>     <p>Es un lugar de retiro y de estudio. Desde aqu&iacute; las Maestras y  Maestros de la Escuela investigan, reflexionan y producen contribuciones  &uacute;tiles para la superaci&oacute;n del sufrimiento y para el conocimiento y la  comprensi&oacute;n de distintos aspectos referidos a la existencia humana.</p>\n</div>'),
