(1752, 'aRichText', NULL, '<div>\n<h4>El Monolito</h4>     <p>Construido completamente en acero inoxidable para reflejar la  &eacute;poca actual, fija la coordenada del tiempo en que se fund&oacute; este lugar y  permite la alineaci&oacute;n del espacio.</p>\n</div>'),
