(1755, 'aRichText', NULL, '<div>\n<h4>La Estela o Muro de Reconocimiento</h4>     <p>Est&aacute;n en ella grabados los nombres de todos quienes contribuyeron  a la construcci&oacute;n del Parque, del mismo modo en que las antiguas  estelas mesopot&aacute;micas, egipcias, sumerias o mayas, esculpidas en piedra,  dejaban testimonios de los acontecimientos o hechos significativos que  sucedieron al momento de ser construidas.</p>\n</div>'),
