(1772, 'aRichText', NULL, '<p><strong>P. Calder&oacute;n / E. Cicari &nbsp;/ A. Garc&iacute;a / A. Lejtman / M.Manzano</strong></p> <ul><li>\n<a href="http://www.parquelareja.org/uploads/media_items/investigacionarqueologica-alquimia-en-praga-y-bohemia.original.pdf">Una Investigaci&oacute;n Arqueol&oacute;gica de la Alquimia en Praga y Bohemia</a>&nbsp;(<a href="http://www.parquelareja.org/uploads/media_items/an-archaeological-research-in-prague-and-bohemia.original.pdf">ENG</a>&nbsp;- <a href="http://www.parquelareja.org/uploads/media_items/eine-archaeologische-forshung-der-alchemie-in-prag-und-boehmen.original.pdf">GER</a>&nbsp;)</li></ul>'),
