(1805, 'aRichText', NULL, '<p>La expresion corporal y el mensaje. El proximo domingo 9 de marzo de 10 a 18hs. Informes e inscripciones:&nbsp;<a target="_blank" href="mailto:floruzuna@gmail.com">floruzuna@gmail.com</a>&nbsp;Cel:15-5421-7017 Los invitamos a compartir una jornada para lograr una conexi&oacute;n con nuestro mundo interno y encontrarnos de un modo no habitual con los otros; se llevara adelante a trav&eacute;s de ejercicios simples. Sera un espacio preparado para gente de todas las edades y generos, y que no requiere de ning&uacute;n entrenamiento ni conocimiento especifico. El cupo es limitado, por razones de espacio por lo que se agradece inscripci&oacute;n previa. Recordar traer ropa comoda.</p>'),
(1806, 'aRichText', NULL, '<h3>La expresion corporal y el mensaje. El proximo domingo 9 de marzo de 10 a 18hs. Informes e inscripciones:&nbsp;<a href="mailto:floruzuna@gmail.com" target="_blank">floruzuna@gmail.com</a>&nbsp;Cel:15-5421-7017 Los invitamos a compartir una jornada para lograr una conexi&oacute;n con nuestro mundo interno y encontrarnos de un modo no habitual con los otros; se llevara adelante a trav&eacute;s de ejercicios simples. Sera un espacio preparado para gente de todas las edades y generos, y que no requiere de ning&uacute;n entrenamiento ni conocimiento especifico. El cupo es limitado, por razones de espacio por lo que se agradece inscripci&oacute;n previa. Recordar traer ropa comoda.</h3>'),
