(1892, 'aRichText', NULL, '<p>&nbsp;S&aacute;bado 21 de Junio - 15 a 17hs. - Multiuso</p><p>Punto de apoyo del observador y veh&iacute;culo del prop&oacute;sito. De Carlos Sotomayor. No se va a contar una historia. Se tratar&aacute; de exponer sobre la des-naturalizaci&oacute;n de la mirada con respecto a la historia y se tomar&aacute; un espacio de tiempo -que representar&aacute; el objeto de estudio- en el cual se rescatar&aacute;n hechos significativos que se enmarcan en la hip&oacute;tesis de trabajo.</p>'),
