(1900, 'aRichText', NULL, '<div><h3>&iexcl;IMPORTANTE! EL VIERNES A, S&Aacute;BADO B Y DOMINGO C DE E LA SALA ESTAR&Aacute; CERRADA POR TAREAS DE MANTENIMIENTO</h3></div> <p>Se estar&aacute;n realizando tareas reparaci&oacute;n y pintura necesarias en la Sala. Como todo en el Parque, estas tareas se realizan con colaboraci&oacute;n voluntaria. Si quer&eacute;s venir a dar una mano, comunicate con Osvaldo Sosa al (11) 15-4444-4444 o escribiendo en el formulario de contacto de la p&aacute;gina&nbsp;</p>'),
(1901, 'aRichText', NULL, '<div>&iexcl;IMPORTANTE! EL VIERNES A, S&Aacute;BADO B Y DOMINGO C DE E LA SALA ESTAR&Aacute; CERRADA POR TAREAS DE MANTENIMIENTO</div> <p>Se estar&aacute;n realizando tareas reparaci&oacute;n y pintura necesarias en la Sala. Como todo en el Parque, estas tareas se realizan con colaboraci&oacute;n voluntaria. Si quer&eacute;s venir a dar una mano, comunicate con Osvaldo Sosa al (11) 15-4444-4444 o escribiendo en el formulario de contacto de la p&aacute;gina&nbsp;</p>'),
