(2053, 'aRawHTML', NULL, '<div style="background-color:#FFC3CC;; border:solid 2px red; text-align:justify; padding:10px; margin-right:10px;">\n<p style="color:red; font-size:14px; text-align:center;">IMPORTANTE</p>\n<p>El <strong>Miércoles 22 de Octubre desde las 10:00HS.</strong> se finalizarán las tareas de mantenimiento en el <strong>interior de la Sala</strong>. Para sumarte a dar una mano, comunicate mediante la sección <a href="http://parquelareja.org/contacto" target="_blank">Contacto</a></p>\n</div>'),
(2054, 'aText', NULL, 'Desde 10:00HS.: Sala, pintura interior'),
