(2056, 'aText', NULL, 'Desde 10:00HS.: Sala, pintura interior'),
(2057, 'aRichText', NULL, '<p><em><strong>Carlos Sotomayor</strong></em></p><ul><li><a href="http://parquelareja.org/uploads/media_items/carlos-sotomayor-el-relato-historico.original.pdf" target="_blank">El Relato Hist&oacute;rico (espa&ntilde;ol)</a></li></ul>'),
(2058, 'aRichText', NULL, '<div><em><strong>Victor Piccininni</strong></em></div><ul><li><a href="http://parquelareja.org/uploads/media_items/victor-piccininni-el-transcurrir.original.pdf" target="_blank">El transcurrir (espa&ntilde;ol)</a> | <a href="http://parquelareja.org/uploads/media_items/victor-piccininni-il-trascorrere.original.pdf" target="_blank">Il trascorrere (italiano)</a> |&nbsp;<a href="http://parquelareja.org/uploads/media_items/victor-piccininni-lecoulement-du-temps.original.pdf" target="_blank">L''&eacute;coulement du temps (fran&ccedil;ais)</a> | <a href="http://parquelareja.org/uploads/media_items/victor-piccininni-times-passage.original.pdf" target="_blank">Time''s passage (English)</a></li><li><a href="http://parquelareja.org/uploads/media_items/victor-piccininni-la-experiencia-del-tiempo.original.pdf" target="_blank">La Experiencia del Tiempo (espa&ntilde;ol)</a> | <a href="http://parquelareja.org/uploads/media_items/victor-piccininni-lesperienza-del-tempo.original.pdf" target="_blank">L''Esperienza del tempo (italiano)</a> | <a href="http://parquelareja.org/uploads/media_items/victor-piccininni-lexperience-du-temp.original.pdf" target="_blank">L''Exp&eacute;rience du Temp (fran&ccedil;ais)</a></li></ul>'),
(2059, 'aRichText', NULL, '<p><em><strong>Ver&oacute;nica Torres</strong></em></p><ul><li><a href="http://parquelareja.org/uploads/media_items/veronica-torres-viaje-interior.original.pdf" target="_blank">Viaje Interior (espa&ntilde;ol)</a></li></ul>'),
(2060, 'aRichText', NULL, '<p><strong>&nbsp;Jano Arrechea</strong></p><ul><li><a href="http://parquelareja.org/uploads/media_items/jano-arrechea-el-campo-de-copresencia-en-la-estructura-conciencia-mundo.original.pdf" target="_blank">El campo de copresencia en la estructura conciencia-mundo&nbsp;(espa&ntilde;ol)</a>&nbsp;| <a href="http://parquelareja.org/uploads/media_items/jano-arrechea-le-champ-de-copresence-dans-la-structure-conscience-monde.original.pdf" target="_blank">Le Champ de Copr&eacute;sence dans la Structure conscience-monde (fran&ccedil;ais)</a></li><li><a href="http://parquelareja.org/uploads/media_items/jano-arrechea-el-deleite-en-la-experiencia-del-silencio.original.pdf" target="_blank">El Deleite en la experiencia del Silencio (espa&ntilde;ol)</a>&nbsp;| <a href="http://parquelareja.org/uploads/media_items/jano-arrechea-the-delight-in-the-experience-of-the-silence.original.pdf" target="_blank">The delight in the experience of the silence (English)</a>&nbsp;| <a href="http://parquelareja.org/uploads/media_items/jano-arrechea-le-delice-dans-lexperience-du-silence.original.pdf" target="_blank">Le D&eacute;lice dans l''experience du Silence (fran&ccedil;ais)</a>&nbsp;| <a href="http://parquelareja.org/uploads/media_items/jano-arrechea-o-deleite-na-experiencia-do-silencio.original.pdf" target="_blank">O Deleite na Experi&ecirc;ncia do Sil&ecirc;ncio (portugu&ecirc;s)</a></li><li><a href="http://parquelareja.org/uploads/media_items/jano-arrechea-sobre-la-alegria.original.pdf" target="_blank">Sobre La Alegr&iacute;a - Estudio breve&nbsp;(espa&ntilde;ol)</a>&nbsp;|&nbsp;<a href="http://parquelareja.org/uploads/media_items/jano-arrechea-a-proposito-dell-allegria.original.pdf" target="_blank">A proposito dell'' alegria (italiano)</a>&nbsp;|&nbsp;<a href="http://parquelareja.org/uploads/media_items/jano-arrechea-a-propos-de-la-joie.original.pdf" target="_blank">&Agrave; Propos de la Joie (fran&ccedil;ais)</a></li><li><a href="http://parquelareja.org/uploads/media_items/jano-arrechea-sobre-las-traducciones.original.pdf" target="_blank">Sobre las Traducciones (espa&ntilde;ol)</a></li><li><a href="http://parquelareja.org/uploads/media_items/jano-arrechea-una-meditacion-en-la-montana.original.pdf" target="_blank">Una meditaci&oacute;n en la monta&ntilde;a&nbsp;(espa&ntilde;ol)</a>&nbsp;|&nbsp;<a href="http://parquelareja.org/uploads/media_items/jano-arrechea-une-meditation-a-la-montagne.original.pdf" target="_blank">Une m&eacute;ditation &agrave; la montagne (fran&ccedil;ais)</a></li></ul><br />'),
(2061, 'aRichText', NULL, '<p><em><strong>Norma Coronel</strong></em></p><ul><li><a href="http://parquelareja.org/uploads/media_items/norma-coronel-procedimientos-de-entrada-a-lo-profundo-en-el-mensaje-de-silo.original.pdf" target="_blank">Procedimientos de Entrada a lo Profundo en El Mensaje de Silo (espa&ntilde;ol)</a>&nbsp;| <a href="http://parquelareja.org/uploads/media_items/norma-coronel-procedures-for-entering-the-profound-in-silos-message.original.pdf" target="_blank">Procedures for Entering the Profound in Silo''s Message (English)</a></li></ul>'),
(2062, 'aRichText', NULL, '<p>Una propuesta es dise&ntilde;ar un plan de trabajo que permita a varios grupos experimentar las distintas partes o etapas de estos inspiradores Oficios.</p><div>&nbsp;</div><div><strong>Oficio del Fuego</strong></div><div>Por ejemplo, pueden haber varios grupos trabajando de modo simult&aacute;neo en distintos temas:</div><div>&nbsp;</div><div>Conservaci&oacute;n del Fuego</div><div>Producci&oacute;n del Fuego</div><div>Materiales fr&iacute;os. moldes de caucho, resinas, cementos, ceras, etc.</div><div>Alfarer&iacute;a. modelado de barro y arcilla, torno, uso de los hornos, esmaltes, Rak&uacute;, etc.</div><div>Metalurgia. fundici&oacute;n de metales, aleaciones, uso de la fragua, crisoles, terminaciones, etc.&nbsp;</div><div>&nbsp;</div><div>El taller del Parque pone a disposici&oacute;n de todos el espacio de trabajo, los hornos y herramientas pesadas.</div><div>&nbsp;</div><div>Cada participante traer&aacute; los materiales que va a necesitar seg&uacute;n su inter&eacute;s para el d&iacute;a. Al finalizar el d&iacute;a recomendamos llevarse las producciones realizadas y los materiales personales. (Ver el material de Oficios)</div><div>&nbsp;</div><div>El aporte personal por el uso del taller ser&aacute; de $ 40 por d&iacute;a, m&aacute;s los materiales que se usen individualmente o en conjunto.</div><div>&nbsp;</div><div>Existe un aporte personal por d&iacute;a de uso del taller que ser&aacute; informado al momento de hacer la reserva, m&aacute;s los materiales que se usen individualmente o en conjunto.&nbsp;</div><div>&nbsp;</div><div><strong>Horno</strong></div><div>Algunos materiales m&iacute;nimos para comenzar son:</div><ul><li>Para la conservaci&oacute;n del fuego, se necesita tierra arcillosa para hacer cuencos.</li><li>Para la producci&oacute;n del fuego, conviene tener distintas piedras: entre ellas cuarzo y pirita. Yesca, hongos, ramitas secas, etc.</li><li>Trabajos en fr&iacute;o, los objetos y sus formas, confecci&oacute;n de cajas y moldes de caucho. coladas de resina, cemento, cera. Traer algunos objetos, inicialmente peque&ntilde;os, para hacer moldes y luego multiplicarlos. cinta de papel, tijera, cart&oacute;n, pl&aacute;sticos, envases, etc. Caucho de silicona, resina poliester, elementos para medir, vasos pl&aacute;sticos, pipetas, etc.</li><li>Alfarer&iacute;a, barro o arcilla, estecas, etc. Veremos diferentes t&eacute;cnicas de modelado, torno de alfarero, moldes de yeso.</li></ul><div>Los objetos producidos se podr&aacute;n hornear la semana siguiente.&nbsp;Estos trabajos son para disc&iacute;pulos, postulantes y amigos en general. Los esperamos.</div><div>&nbsp;</div><div>Comisi&oacute;n / Parques de Estudio y Reflexi&oacute;n, La Reja</div><div>&nbsp;</div><div>Para reservas, hacer <a href="http://parquelareja.org/reserva">click aqu&iacute;</a>.&nbsp;</div><br />'),
(2063, 'aRichText', NULL, '<h3>Taller</h3>'),
(2064, 'aRichText', NULL, '<p>Una propuesta es dise&ntilde;ar un plan de trabajo que permita a varios grupos experimentar las distintas partes o etapas de estos inspiradores Oficios.</p><div>&nbsp;</div><div><strong>Oficio del Fuego</strong></div><div>Por ejemplo, pueden haber varios grupos trabajando de modo simult&aacute;neo en distintos temas:</div><div>&nbsp;</div><div>Conservaci&oacute;n del Fuego</div><div>Producci&oacute;n del Fuego</div><div>Materiales fr&iacute;os. moldes de caucho, resinas, cementos, ceras, etc.</div><div>Alfarer&iacute;a. modelado de barro y arcilla, torno, uso de los hornos, esmaltes, Rak&uacute;, etc.</div><div>Metalurgia. fundici&oacute;n de metales, aleaciones, uso de la fragua, crisoles, terminaciones, etc.&nbsp;</div><div>&nbsp;</div><div>El taller del Parque pone a disposici&oacute;n de todos el espacio de trabajo, los hornos y herramientas pesadas.</div><div>&nbsp;</div><div>Cada participante traer&aacute; los materiales que va a necesitar seg&uacute;n su inter&eacute;s para el d&iacute;a. Al finalizar el d&iacute;a recomendamos llevarse las producciones realizadas y los materiales personales. (Ver el material de Oficios)</div><div>&nbsp;</div><div>El aporte personal por el uso del taller ser&aacute; de $ 40 por d&iacute;a, m&aacute;s los materiales que se usen individualmente o en conjunto.</div><div>&nbsp;</div><div>Existe un aporte personal por d&iacute;a de uso del taller que ser&aacute; informado al momento de hacer la reserva, m&aacute;s los materiales que se usen individualmente o en conjunto.&nbsp;</div><div>&nbsp;</div><div><strong>Horno</strong></div><div>Algunos materiales m&iacute;nimos para comenzar son:</div><ul><li>Para la conservaci&oacute;n del fuego, se necesita tierra arcillosa para hacer cuencos.</li><li>Para la producci&oacute;n del fuego, conviene tener distintas piedras: entre ellas cuarzo y pirita. Yesca, hongos, ramitas secas, etc.</li><li>Trabajos en fr&iacute;o, los objetos y sus formas, confecci&oacute;n de cajas y moldes de caucho. coladas de resina, cemento, cera. Traer algunos objetos, inicialmente peque&ntilde;os, para hacer moldes y luego multiplicarlos. cinta de papel, tijera, cart&oacute;n, pl&aacute;sticos, envases, etc. Caucho de silicona, resina poliester, elementos para medir, vasos pl&aacute;sticos, pipetas, etc.</li><li>Alfarer&iacute;a, barro o arcilla, estecas, etc. Veremos diferentes t&eacute;cnicas de modelado, torno de alfarero, moldes de yeso.</li></ul><div>Los objetos producidos se podr&aacute;n hornear la semana siguiente.&nbsp;Estos trabajos son para disc&iacute;pulos, postulantes y amigos en general. Los esperamos.</div><div>&nbsp;</div><div>Comisi&oacute;n / Parques de Estudio y Reflexi&oacute;n, La Reja</div><div>&nbsp;</div><div>Para reservas, hacer <a href="http://parquelareja.org/reserva">click aqu&iacute;</a>.&nbsp;</div><br />'),
(2065, 'aRichText', NULL, '<div>Una propuesta es dise&ntilde;ar un plan de trabajo que permita a varios grupos experimentar las distintas partes o etapas de estos inspiradores Oficios.</div>\n<div>&nbsp;</div>\n<div><strong>Oficio del Fuego</strong></div>\n<div>Por ejemplo, pueden haber varios grupos trabajando de modo simult&aacute;neo en distintos temas:</div>\n<div>&nbsp;</div>\n<div>Conservaci&oacute;n del Fuego</div>\n<div>Producci&oacute;n del Fuego</div>\n<div>Materiales fr&iacute;os. moldes de caucho, resinas, cementos, ceras, etc.</div>\n<div>Alfarer&iacute;a. modelado de barro y arcilla, torno, uso de los hornos, esmaltes, Rak&uacute;, etc.</div>\n<div>Metalurgia. fundici&oacute;n de metales, aleaciones, uso de la fragua, crisoles, terminaciones, etc.&nbsp;</div>\n<div>&nbsp;</div>\n<div>El taller del Parque pone a disposici&oacute;n de todos el espacio de trabajo, los hornos y herramientas pesadas.</div>\n<div>&nbsp;</div>\n<div>Cada participante traer&aacute; los materiales que va a necesitar seg&uacute;n su inter&eacute;s para el d&iacute;a. Al finalizar el d&iacute;a recomendamos llevarse las producciones realizadas y los materiales personales. (Ver el material de Oficios)</div>\n<div>&nbsp;</div>\n<div>El aporte personal por el uso del taller ser&aacute; de $ 40 por d&iacute;a, m&aacute;s los materiales que se usen individualmente o en conjunto.</div>\n<div>&nbsp;</div>\n<div>Existe un aporte personal por d&iacute;a de uso del taller que ser&aacute; informado al momento de hacer la reserva, m&aacute;s los materiales que se usen individualmente o en conjunto.&nbsp;</div>\n<div>&nbsp;</div>\n<div><strong>Horno</strong></div>\n<div>Algunos materiales m&iacute;nimos para comenzar son:</div>\n<ul><li>Para la conservaci&oacute;n del fuego, se necesita tierra arcillosa para hacer cuencos.</li>\n    <li>Para la producci&oacute;n del fuego, conviene tener distintas piedras: entre ellas cuarzo y pirita. Yesca, hongos, ramitas secas, etc.</li>\n    <li>Trabajos en fr&iacute;o, los objetos y sus formas, confecci&oacute;n de cajas y moldes de caucho. coladas de resina, cemento, cera. Traer algunos objetos, inicialmente peque&ntilde;os, para hacer moldes y luego multiplicarlos. cinta de papel, tijera, cart&oacute;n, pl&aacute;sticos, envases, etc. Caucho de silicona, resina poliester, elementos para medir, vasos pl&aacute;sticos, pipetas, etc.</li>\n    <li>Alfarer&iacute;a, barro o arcilla, estecas, etc. Veremos diferentes t&eacute;cnicas de modelado, torno de alfarero, moldes de yeso.</li>\n</ul><div>Los objetos producidos se podr&aacute;n hornear la semana siguiente.&nbsp;Estos trabajos son para disc&iacute;pulos, postulantes y amigos en general. Los esperamos.</div>\n<div>&nbsp;</div>\n<div>Comisi&oacute;n / Parques de Estudio y Reflexi&oacute;n, La Reja</div>\n<div>&nbsp;</div>\n<div>Para reservas, hacer <a href="http://parquelareja.org/reserva">click aqu&iacute;</a>.&nbsp;</div>\n<br />'),
(2066, 'aRichText', NULL, '<div>Una propuesta es dise&ntilde;ar un plan de trabajo que permita a varios grupos experimentar las distintas partes o etapas de estos inspiradores Oficios.</div> <div>&nbsp;</div> <div><strong>Oficio del Fuego</strong></div> <div>Por ejemplo, pueden haber varios grupos trabajando de modo simult&aacute;neo en distintos temas:</div> <div>&nbsp;</div> <div>Conservaci&oacute;n del Fuego</div> <div>Producci&oacute;n del Fuego</div> <div>Materiales fr&iacute;os. moldes de caucho, resinas, cementos, ceras, etc.</div> <div>Alfarer&iacute;a. modelado de barro y arcilla, torno, uso de los hornos, esmaltes, Rak&uacute;, etc.</div> <div>Metalurgia. fundici&oacute;n de metales, aleaciones, uso de la fragua, crisoles, terminaciones, etc.&nbsp;</div> <div>&nbsp;</div> <div>El taller del Parque pone a disposici&oacute;n de todos el espacio de trabajo, los hornos y herramientas pesadas.</div> <div>&nbsp;</div> <div>Cada participante traer&aacute; los materiales que va a necesitar seg&uacute;n su inter&eacute;s para el d&iacute;a. Al finalizar el d&iacute;a recomendamos llevarse las producciones realizadas y los materiales personales. (Ver el material de Oficios)</div> <div>&nbsp;</div> <div>Existe un aporte personal por d&iacute;a de uso del taller que ser&aacute; informado al momento de hacer la reserva, m&aacute;s los materiales que se usen individualmente o en conjunto.&nbsp;</div>   <div>&nbsp;</div> <div><strong>Horno</strong></div> <div>Algunos materiales m&iacute;nimos para comenzar son:</div> <ul><li>Para la conservaci&oacute;n del fuego, se necesita tierra arcillosa para hacer cuencos.</li>     <li>Para la producci&oacute;n del fuego, conviene tener distintas piedras: entre ellas cuarzo y pirita. Yesca, hongos, ramitas secas, etc.</li>     <li>Trabajos en fr&iacute;o, los objetos y sus formas, confecci&oacute;n de cajas y moldes de caucho. coladas de resina, cemento, cera. Traer algunos objetos, inicialmente peque&ntilde;os, para hacer moldes y luego multiplicarlos. cinta de papel, tijera, cart&oacute;n, pl&aacute;sticos, envases, etc. Caucho de silicona, resina poliester, elementos para medir, vasos pl&aacute;sticos, pipetas, etc.</li>     <li>Alfarer&iacute;a, barro o arcilla, estecas, etc. Veremos diferentes t&eacute;cnicas de modelado, torno de alfarero, moldes de yeso.</li> </ul><div>Los objetos producidos se podr&aacute;n hornear la semana siguiente.&nbsp;Estos trabajos son para disc&iacute;pulos, postulantes y amigos en general. Los esperamos.</div> <div>&nbsp;</div> <div>Comisi&oacute;n / Parques de Estudio y Reflexi&oacute;n, La Reja</div> <div>&nbsp;</div> <div>Para reservas, hacer <a href="http://parquelareja.org/reserva">click aqu&iacute;</a>.&nbsp;</div> <br />'),
(2067, 'aRichText', NULL, '<div>Una propuesta es dise&ntilde;ar un plan de trabajo que permita a varios grupos experimentar las distintas partes o etapas de estos inspiradores Oficios.</div> <div>&nbsp;</div> <div><strong>Oficio del Fuego</strong></div> <div>Por ejemplo, pueden haber varios grupos trabajando de modo simult&aacute;neo en distintos temas:</div> <div>&nbsp;</div> <div>Conservaci&oacute;n del Fuego</div> <div>Producci&oacute;n del Fuego</div> <div>Materiales fr&iacute;os. moldes de caucho, resinas, cementos, ceras, etc.</div> <div>Alfarer&iacute;a. modelado de barro y arcilla, torno, uso de los hornos, esmaltes, Rak&uacute;, etc.</div> <div>Metalurgia. fundici&oacute;n de metales, aleaciones, uso de la fragua, crisoles, terminaciones, etc.&nbsp;</div> <div>&nbsp;</div> <div>El taller del Parque pone a disposici&oacute;n de todos el espacio de trabajo, los hornos y herramientas pesadas.</div> <div>&nbsp;</div> <div>Cada participante traer&aacute; los materiales que va a necesitar seg&uacute;n su inter&eacute;s para el d&iacute;a. Al finalizar el d&iacute;a recomendamos llevarse las producciones realizadas y los materiales personales. (Ver el material de Oficios)</div> <div>&nbsp;</div> <div>Existe un aporte personal por d&iacute;a de uso del taller que ser&aacute; informado al momento de hacer la reserva, m&aacute;s los materiales que se usen individualmente o en conjunto. Para consultar el aporte personal por d&iacute;a de uso, hacer <a href="http://parquelareja.org/contacto">click aqu&iacute;</a>.&nbsp;</div>   <div>&nbsp;</div> <div><strong>Horno</strong></div> <div>Algunos materiales m&iacute;nimos para comenzar son:</div> <ul><li>Para la conservaci&oacute;n del fuego, se necesita tierra arcillosa para hacer cuencos.</li>     <li>Para la producci&oacute;n del fuego, conviene tener distintas piedras: entre ellas cuarzo y pirita. Yesca, hongos, ramitas secas, etc.</li>     <li>Trabajos en fr&iacute;o, los objetos y sus formas, confecci&oacute;n de cajas y moldes de caucho. coladas de resina, cemento, cera. Traer algunos objetos, inicialmente peque&ntilde;os, para hacer moldes y luego multiplicarlos. cinta de papel, tijera, cart&oacute;n, pl&aacute;sticos, envases, etc. Caucho de silicona, resina poliester, elementos para medir, vasos pl&aacute;sticos, pipetas, etc.</li>     <li>Alfarer&iacute;a, barro o arcilla, estecas, etc. Veremos diferentes t&eacute;cnicas de modelado, torno de alfarero, moldes de yeso.</li> </ul><div>Los objetos producidos se podr&aacute;n hornear la semana siguiente.&nbsp;Estos trabajos son para disc&iacute;pulos, postulantes y amigos en general. Los esperamos.</div> <div>&nbsp;</div> <div>Comisi&oacute;n / Parques de Estudio y Reflexi&oacute;n, La Reja</div> <div>&nbsp;</div> <div>Para reservas, hacer <a href="http://parquelareja.org/reserva">click aqu&iacute;</a>.&nbsp;</div> <br />');
