(2068, 'aRichText', NULL, '<div>Una propuesta es dise&ntilde;ar un plan de trabajo que permita a varios grupos experimentar las distintas partes o etapas de estos inspiradores Oficios.</div> <div>&nbsp;</div> <div><strong>Oficio del Fuego</strong></div> <div>Por ejemplo, pueden haber varios grupos trabajando de modo simult&aacute;neo en distintos temas:</div> <div>&nbsp;</div> <div>Conservaci&oacute;n del Fuego:&nbsp;</div>    <ul><li>Producci&oacute;n del Fuego</li><li>Materiales fr&iacute;os. moldes de caucho, resinas, cementos, ceras, etc.</li><li>Alfarer&iacute;a. modelado de barro y arcilla, torno, uso de los hornos, esmaltes, Rak&uacute;, etc.</li><li>Metalurgia. fundici&oacute;n de metales, aleaciones, uso de la fragua, crisoles, terminaciones, etc.&nbsp;</li></ul><div>&nbsp;</div> <div>El taller del Parque pone a disposici&oacute;n de todos el espacio de trabajo, los hornos y herramientas pesadas.</div> <div>&nbsp;</div> <div>Cada participante traer&aacute; los materiales que va a necesitar seg&uacute;n su inter&eacute;s para el d&iacute;a. Al finalizar el d&iacute;a recomendamos llevarse las producciones realizadas y los materiales personales. (Ver el material de Oficios)</div> <div>&nbsp;</div> <div>Existe un aporte personal por d&iacute;a de uso del taller que ser&aacute; informado al momento de hacer la reserva, m&aacute;s los materiales que se usen individualmente o en conjunto. Para consultar el aporte personal por d&iacute;a de uso, hacer <a href="http://parquelareja.org/contacto">click aqu&iacute;</a>.&nbsp;</div>   <div>&nbsp;</div> <div><strong>Horno</strong></div> <div>Algunos materiales m&iacute;nimos para comenzar son:</div> <ul><li>Para la conservaci&oacute;n del fuego, se necesita tierra arcillosa para hacer cuencos.</li>     <li>Para la producci&oacute;n del fuego, conviene tener distintas piedras: entre ellas cuarzo y pirita. Yesca, hongos, ramitas secas, etc.</li>     <li>Trabajos en fr&iacute;o, los objetos y sus formas, confecci&oacute;n de cajas y moldes de caucho. coladas de resina, cemento, cera. Traer algunos objetos, inicialmente peque&ntilde;os, para hacer moldes y luego multiplicarlos. cinta de papel, tijera, cart&oacute;n, pl&aacute;sticos, envases, etc. Caucho de silicona, resina poliester, elementos para medir, vasos pl&aacute;sticos, pipetas, etc.</li>     <li>Alfarer&iacute;a, barro o arcilla, estecas, etc. Veremos diferentes t&eacute;cnicas de modelado, torno de alfarero, moldes de yeso.</li> </ul><div>Los objetos producidos se podr&aacute;n hornear la semana siguiente.&nbsp;Estos trabajos son para disc&iacute;pulos, postulantes y amigos en general. Los esperamos.</div> <div>&nbsp;</div> <div>Comisi&oacute;n / Parques de Estudio y Reflexi&oacute;n, La Reja</div> <div>&nbsp;</div> <div>Para reservas, hacer <a href="http://parquelareja.org/reserva">click aqu&iacute;</a>.&nbsp;</div> <br />'),
