(2162, 'aRichText', NULL, '<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong> &nbsp;<strong>&iexcl;Bienvenidos a nuestro Parque!</strong></p> <br /><p>El uso de sus instalaciones est&aacute; destinado primordialmente a reuniones, retiros y seminarios de</p> <p>estudio y reflexi&oacute;n. .</p> <p>Este breve instructivo incluye la informaci&oacute;n necesaria para quienes hagan uso de las</p> <p>instalaciones del Parque. Toda otra consulta puede hacerse mediante el <a href="http://parquelareja.org/contacto" target="_blank">formulario de contacto</a>.&nbsp;</p> <br /><p><strong>HORARIO&nbsp;DEL PARQUE&nbsp;</strong></p><p><strong>VERANO</strong>&nbsp;</p><p>Lunes a Jueves: de 10 a 13hs. y de 15 a 19hs.<br />Viernes: de 10 a 13hs. y de 15 a 21hs.&nbsp;<br />S&aacute;bados: de 10 a 21hs.&nbsp;<br />Domingos: de 10 a 20hs.&nbsp;<br />V&iacute;speras de feriados: de 10 a 13hs. y de 15 a 21hs.&nbsp;<br />&nbsp;</p><p><strong>INVIERNO</strong></p><p>Lunes a Jueves: de 10 a 13hs. y de 15 a 18hs.&nbsp;<br />Viernes: de 10 a 13hs. y de 15 a 20hs.<br />S&aacute;bados: de 10 a 20hs.&nbsp;<br />Domingos: de 10 a 19hs.&nbsp;<br />V&iacute;speras de feriados: de 10 a 13hs. y de 15 a 20hs.&nbsp;</p> <br /><p><strong>Multiuso: </strong>Cuenta con 12 mesas y 48 sillas, no es de uso exclusivo, no se reserva, pero s&iacute; se</p> <p>puede anunciar el uso en la web para que se coordinen las distintas actividades que pudieran</p> <p>realizarse all&iacute;. Hay un espacio destinado al autoservicio, con microondas, cafeteras y termos.</p> <br /><p><strong>Taller: </strong>para su reserva y uso ver instructivo espec&iacute;fico (en la pesta&ntilde;a "Reserva").</p> <br /><p><strong>Centro de Trabajo: </strong>Es el &aacute;mbito donde miembros del Movimiento Humanista y de sus</p> <p>organismos y los amigos de El Mensaje de Silo realizan seminarios y retiros. La capacidad total</p> <p>de alojamiento es de 15 personas, cinco (5) por habitaci&oacute;n como m&aacute;ximo.</p> <p>Cuenta tambi&eacute;n con un sal&oacute;n/estar con capacidad para 250 personas sentadas o 100</p> <p>distribuidas en mesas. Es conveniente que quienes reserven el sal&oacute;n del C de T informen el</p> <p>n&uacute;mero de mesas y sillas requeridas.</p> <br /><p><strong>Centro de Estudio:</strong> Es el &aacute;mbito de Escuela donde los Maestros realizan sus trabajos y</p> <p>estudios. La capacidad total de alojamiento es de 16 personas.</p> <p>Cuenta tambi&eacute;n con un sal&oacute;n central con capacidad para 60 personas; una salita de reuni&oacute;n/</p> <p>escritorio y un desayunador.</p> <br /><p>En ambos Centros, las cocinas equipadas cuentan, adem&aacute;s, con microondas, termos, ollas,</p> <p>sartenes y vajilla. Los salones cuentan con mesas y sillas. Las habitaciones disponen de</p> <p>s&aacute;banas, toallones, toallas, mantas y acolchados para cada persona.</p> <br /><p><strong>Estacionamiento:</strong> el acceso para el Centro de Trabajo es por el port&oacute;n de Alfonsina</p> <p>Storni, al lado de ese Centro. Para el Centro de Estudios el estacionamiento tiene su ingreso</p> <p>por la calle Rocha Blaquier.</p> <br /><p><strong>Internet:</strong> todos los &aacute;mbitos tienen WiFi.</p> <br /><p><strong>Reservas Centro de Trabajo y Centro de Estudios</strong></p> <p>Las reservas se hacen por la Web: www.parquelareja.org en la pestana<strong> &ldquo;Reserva&rdquo;,</strong></p> <p>completando los datos del formulario que llegar&aacute; al equipo que coordina esto, quienes, a</p> <p>vuelta de correo, confirmaran la misma enviando los particulares. Se tendr&aacute; en cuenta el orden</p> <p>de llegada de los pedidos de reserva.</p> <p>Se puede consultar la pestana<strong> &ldquo;Calendario de uso&rdquo; </strong>para ver la disponibilidad de los Centros.</p> <p>En el caso que las habitaciones no se ocupen en su totalidad por un grupo, las camas libres</p> <p>quedar&aacute;n disponibles para otras reservas y no se tendr&aacute; uso exclusivo de los salones de los</p> <p>respectivos Centros.</p> <br /><p><strong>Horario de ingreso y egreso</strong></p> <br /><p>Cuando se reserva cualquiera de los Centros, el horario de ingreso a las habitaciones es a las 18.30 hs. y el de salida a las 17.30 Hs. del d&iacute;a siguiente.</p> <p><br />Si la reserva es por el d&iacute;a, sin uso de habitaciones, el horario de entrada es a las 10 hs. y el de salida a las 20 hs. Al llegar y retirarse, por favor, avisar al cuidador.<br />&nbsp;</p> <br /><p><strong>Breves consideraciones de uso</strong></p> <p><strong>Al llegar:</strong></p> <p>La persona responsable recibe un juego de llaves, compuesto por las llaves del Centro de Trabajo o Estudio, la de una puerta de la Sala y ambos portones a los estacionamientos.</p> <p><strong>Al final del d&iacute;a:</strong></p> <br /><p>Una persona del grupo tendr&iacute;a que verificar que est&eacute;n cerradas con llave todas las puertas, incluida la de la Sala.</p> <br /><p>Se apagan las luces interiores. En invierno, se baja la temperatura o se apagan las estufas, incluidas las de la Sala. Se verifica que las llaves de paso del gas est&eacute;n cerradas, tambi&eacute;n la de la cocina.</p> <p><strong>Al retirarse:</strong></p> <p>Verificar que no queden canillas abiertas, p&eacute;rdidas de inodoro, luces encendidas, estufas el&eacute;ctricas enchufadas y de gas apagadas y llaves de paso cerradas.<br />Las toallas se pueden depositar en los cestos en las habitaciones y las s&aacute;banas sobre la cama.&nbsp;<br />Se entrega el juego de llaves al casero o a los cuidadores.</p> <br /><p><b>Uso de la cocina:</b><br />Es posible cocinar dejando todo en el mismo estado que se lo encontr&oacute;.<br />Si surgiera alg&uacute;n desperfecto o emergencia, avisar al cuidador del Parque.<br />Si surgiera alguna emergencia m&eacute;dica, contactar con el servicio Vittal. (Tel&eacute;fonos: 4000-888&nbsp;o&nbsp;4556-4556&nbsp;N&ordm; de cliente 862947)</p> <p>Muchas gracias</p> <p>Comisi&oacute;n de Parque La Reja</p> <br />'),
