(2164, 'aText', NULL, '14hs. Declaraci&oacute;n de Fuji'),
(2165, 'aRichText', NULL, '<p>Desde La Comunidad (para el desarrollo humano), Equipo Base Voluntarios del Mundo, organismo con el que estamos llevando adelante el Proyecto Ciudades No-violentas con el frente Consejos Permanentes por la No-violencia Activa (C.P.N.V.A.), &nbsp;realizaremos en nuestro Parque de Estudio y Reflexi&oacute;n La Reja, &nbsp;junto con otras organizaciones, el lanzamiento en Argentina de la Declaraci&oacute;n de Fuji, el d&iacute;a S&aacute;bado&nbsp;16 de Mayo a las 14hs.&nbsp;</p><div>La Declaraci&oacute;n de Fuji es un alianza internacional de individuos y organizaciones unidos por el compromiso de vivir y colaborar para el avance de un mundo m&aacute;s armonioso y pr&oacute;spero,&nbsp;es una invitaci&oacute;n para personas de todas las naciones y formas de vida, a unirse a un prop&oacute;sito com&uacute;n m&aacute;s all&aacute; de las fronteras, es un llamado a evolucionar conscientemente, en forma unida y con la naturaleza, para crear un nuevo mundo. TE ESPERAMOS!!!</div><div>&nbsp;</div><div>M&aacute;s informaci&oacute;n:&nbsp;<a href="mailto:mirtagatica@hotmail.com" target="_blank">mirtagatica@hotmail.com</a></div><div>http://fujideclaration.org/es/</div><div>http://www.fujideclaration.org/</div><div>http://www.byaako-es.org/</div>'),
(2166, 'aText', NULL, '14hs. Declaraci&oacute;n de Fuji'),
(2167, 'aText', NULL, '14hs. Declaraci&oacute;n de Fuji'),
(2168, 'aRichText', NULL, '<p>Desde La Comunidad (para el desarrollo humano), Equipo Base Voluntarios del Mundo, organismo con el que estamos llevando adelante el Proyecto Ciudades No-violentas con el frente Consejos Permanentes por la No-violencia Activa (C.P.N.V.A.), realizaremos en nuestro Parque de Estudios y Reflexi&oacute;n La Reja, junto con otras organizaciones, el lanzamiento en Argentina de la Declaraci&oacute;n de Fuji, el d&iacute;a S&aacute;bado&nbsp;16 de Mayo a las 14hs.&nbsp;</p><div>La Declaraci&oacute;n de Fuji es un alianza internacional de individuos y organizaciones unidos por el compromiso de vivir y colaborar para el avance de un mundo m&aacute;s armonioso y pr&oacute;spero,&nbsp;es una invitaci&oacute;n para personas de todas las naciones y formas de vida, a unirse a un prop&oacute;sito com&uacute;n m&aacute;s all&aacute; de las fronteras, es un llamado a evolucionar conscientemente, en forma unida y con la naturaleza, para crear un nuevo mundo. TE ESPERAMOS!!!</div><div>&nbsp;</div><div>M&aacute;s informaci&oacute;n: <a href="mailto:mirtagatica@hotmail.com">mirtagatica@hotmail.com</a></div><div>&nbsp;</div><div><a href="http://fujideclaration.org/es/" target="_blank">http://fujideclaration.org/es/</a>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<i><a href="http://www.fujideclaration.org/" target="_blank">www.fujideclaration.org</a>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href="http://www.byakko-es.org/" target="_blank">www.byakko-es.org</a></i></div>'),
